(7, 1, 44, '2015-03-25 20:35:04', 'Bienvenue', '<p>Bienvenue &agrave; toi sur freeostorrent.fr ! :)</p>', '1'),
(8, 45, 1, '2015-03-30 23:15:26', 'Deamandes d''information sur le fonctionnement du nouveau site', '<p>Salut Mumbly,</p>\r\n<p>J''ai deux petites questions :</p>\r\n<p>- Comment faire pour modifier l''annonce apr&egrave;s sa publication, car lorsque je clique sur &eacute;diter le syst&egrave;me me renvoie sur la page d''acceuil des torrents.</p>\r\n<p>- Comment faire pour avoir la liste de tous les t&eacute;l&eacute;chargements d''Emmabunt&uuml;s, comme sur freetoorent :</p>\r\n<p><a href="http://www.freetorrent.fr/index.php?page=torrents&amp;search=emmabuntus&amp;category=0&amp;active=0">http://www.freetorrent.fr/index.php?page=torrents&amp;search=emmabuntus&amp;category=0&amp;active=0</a></p>\r\n<p>Afin de pouvoir mettre un liens direct sur notre page de t&eacute;l&eacute;chargements : <a href="http://download.emmabuntus.org">http://download.emmabuntus.org</a></p>\r\n<p>Merci d''avance pour ton aide.</p>\r\n<p>Bien &agrave; toi.</p>\r\n<p>Patrick</p>', '1'),
(36, 1, 0, '2015-07-18 07:44:17', 'Re: Ceci est encore un test dis-donc !', '<blockquote>\r\n<p>Bienvenue dans votre messagerie ! Personnalisez votre bo&icirc;te de r&eacute;ception avec de magnifiques th&egrave;mes et organisez vos mails comme vous le souhaitez ! Acc&eacute;dez en un clic aux outils que vous utilisez tous les jours, tels que l&rsquo;agenda, le bloc-notes, les contacts, les messages instantan&eacute;s et la fonction Recherche. Notre barre d&rsquo;outils et d''actions vous permettent de trier, marquer ou supprimer des mails en seulement quelques clics.</p>\r\n</blockquote>\r\n<p>Ah ok ! :)</p>\r\n<p>a+</p>', '0'),
