(11, 1, 52, '2015-04-29 08:52:09', 'PrimTux', '<p>Bonjour,<br /> Merci d''utiliser les services de freeostorrent.fr !<br /> Le torrent de Primtux que vous avez d&eacute;pos&eacute; est estampill&eacute; d''une lcience C.C. By-Nc. Ce qui m''&eacute;tonne si cette distribution est bas&eacute;e sur Debian Jessie qui elle est obligatoirement sous licence GPL. Pourriez-vous v&eacute;rifier/confirmer/infirmer ? Et &eacute;ventuellement, au cas ou, changer directement la licence de ce torrent ? Merci !<br /> Cordialement.<br /> Mumbly</p>', '0'),
(12, 1, 53, '2015-05-03 07:26:37', 'Linuxconsole', '<p>Bonjour,</p>\r\n<p>Merci pour votre partage de Linuxconsole. Pourriez-vous rajouter, dans la pr&eacute;sentation du torrent&nbsp; :</p>\r\n<p>- une adresse web du projet</p>\r\n<p>- une image du projet</p>\r\n<p>Merci ! Bien cordialement,</p>\r\n<p>Mumbly, webmaster</p>', '1'),
(14, 1, 12, '2015-06-29 07:35:24', 'Bienvenue', '<p>Eco bienvenue !</p>', '0');
INSERT INTO `blog_posts_comments` (`cid`, `cid_torrent`, `cadded`, `ctext`, `cuser`) VALUES
(1, 2, '2015-01-07 09:33:37', '<p>Manjaro = Archlinux pour les nuls ! ;) Super distrib, simple, fiable, efficace !</p>', 'mumbly'),
(2, 2, '2015-01-10 10:37:57', '<p>Apr&egrave;s avoir utilis&eacute; (un peu) Arch LInux, je me suis tourn&eacute; vers cette distribution qui m''a enchant&eacute;. Simple, reprenant les bases de Arch Linux, AUR est un gisement sans fond d''applications souvent indispensable (pour moi en tout cas, comme Teamviewer par exemple). je l''utilise depuis plusieurs mois et j''en suis super content !</p>', 'olivier'),
(3, 24, '2015-01-15 15:09:56', '<p>Le meilleur OS pour un serveur !!!</p>', 'olivier'),
(5, 28, '2015-01-19 09:41:16', '<p>Excellente distribution, bas&eacute;e sur Debian, peut-&ecirc;tre compl&eacute;mentaire de <a href="https://www.google.fr/url?sa=t&amp;rct=j&amp;q=&amp;esrc=s&amp;source=web&amp;cd=1&amp;cad=rja&amp;uact=8&amp;ved=0CCMQFjAA&amp;url=https%3A%2F%2Fwww.kali.org%2F&amp;ei=CsO8VIPQLMG0UZKngBA&amp;usg=AFQjCNHczlD7OWcngq_h2VJY_s8Tx3BK8A&amp;sig2=qT75cuR7DOqpBf6XKyGfeQ&amp;bvm=bv.83829542,d.d24">Kali Linux</a>&nbsp;? En totu cas, dans la meme lign&eacute;e...</p>', 'mumbly'),
(6, 7, '2015-01-19 14:58:58', '<p>Bonjour<br />\r\nJe suis en "test" avec les linux ( pour l''instant j''ai encore w&sect; 7), et en lisant les articles je suis tomb&eacute; sur cette "version" dite Deepin alors ben....je veux test&eacute;. ;)<br />\r\nMerci pour la mise &agrave; disposition et bonne chance pour v&ocirc;tre aventure.</p>', 'kÃ©kÃ©6784'),
(7, 7, '2015-01-19 15:08:45', '<p>Bonne aventure avec Gnu/Linux et merci pour les encouragements !&nbsp;<img title="glasses" src="js/tinymce/plugins/smileys/img/glasses.png" alt="" /></p>', 'mumbly');
INSERT INTO `blog_posts_seo` (`postID`, `postTitle`, `postAuthor`, `postSlug`, `postDesc`, `postCont`, `postTaille`, `postDate`, `postTorrent`, `postImage`, `postViews`) VALUES
(1, 'Manjaro-kde-0.8.11-x86_64', 'mumbly', 'manjaro-kde-0-8-11-x86-64', '<p><strong>VERSION KDE</strong><br /> <strong>Manjaro Linux</strong>, ou tout simplement <strong>Manjaro</strong> (prononc&eacute; comme dans Kilimanjaro), est une distribution Linux utilisant XFCE comme interface utilisateur par d&eacute;faut. C''est d''abord un syst&egrave;me d''exploitation libre pour ordinateurs personnels qui sait rester simple d''utilisation tout en mettant &agrave; disposition la richesse de la communaut&eacute; Arch Linux. Il utilise par ailleurs un mod&egrave;le de d&eacute;veloppement similaire &agrave; sa grande s&oelig;ur, de type <em>rolling release</em>.</p>', '<p><span class="Quote">We are happy to announce the final release of Manjaro Linux 0.8.11. The Xfce edition remains our flagship offering and has received the attention it deserves. Few can claim to offer such a polished, integrated and leading-edge Xfce experience. We ship components from the Xfce 4.11 series after having tested them in-house, ensuring suitability for everyday use. This edition now uses LightDM for login management, display locking and user switching, including custom integration for Xfce. Spearheaded by the Turkish Manjaro community, our KDE edition continues to deliver this powerful, mature and feature-rich desktop environment with a unique look-and-feel and with the perks of Manjaro''s latest tools.</span></p>\r\n<p><span class="Quote"><span id="result_box" lang="fr"><span class="hps">Nous</span> <span class="hps">sommes heureux d''annoncer</span> <span class="hps">la version finale de</span> <span class="hps">Linux</span> <span class="hps">0.8.11</span> <span class="hps">Manjaro</span>. <span class="hps">L''&eacute;dition</span> <span class="hps">Xfce</span> <span class="hps">reste</span> <span class="hps">notre offre</span> <span class="hps">phare</span> <span class="hps">et</span> <span class="hps">a re&ccedil;u</span> <span class="hps">l''attention qu''elle m&eacute;rite</span>. <span class="hps">Peu de gens peuvent</span> <span class="hps">pr&eacute;tendre offrir</span> <span class="hps">une exp&eacute;rience</span> <span class="hps">Xfce</span> <span class="hps">polie,</span> <span class="hps">int&eacute;gr&eacute;e et</span> <span class="hps">de pointe</span>. <span class="hps">Nous exp&eacute;dions</span> les <span class="hps">composants</span> <span class="hps">de la s&eacute;rie</span> <span class="hps">Xfce</span> <span class="hps">4.11</span> <span class="hps">apr&egrave;s les avoir</span> <span class="hps">test&eacute; en interne</span>, <span class="hps">assurer</span> <span class="hps">l''ad&eacute;quation</span> <span class="hps">pour un usage quotidien</span>. <span class="hps">Cette &eacute;dition</span> <span class="hps">utilise maintenant</span> <span class="hps">LightDM</span> <span class="hps">pour la gestion</span> <span class="hps">de la connexion</span>, du verrouillage <span class="hps">de l''&eacute;cran et</span> du<span class="hps"> changement d''utilisateur</span>, <span class="hps">y compris l''int&eacute;gration</span> <span class="hps">personnalis&eacute;e pour</span> <span class="hps">Xfce</span>.</span></span></p>\r\n<p><strong><span class="Quote"><span id="result_box" lang="fr"><span class="hps">Men&eacute; par</span> <span class="hps">la communaut&eacute;</span> <span class="hps">turque</span> <span class="hps">Manjaro</span>, <span class="hps">notre</span> <span class="hps">&eacute;dition</span> <span class="hps">KDE</span> <span class="hps">continue &agrave;</span> <span class="hps">livrer ce</span> <span class="hps">puissant environnement</span>, mature <span class="hps">et riche en fonctionnalit&eacute;s</span> <span class="hps">de bureau</span> <span class="hps">avec un look</span>-and-feel <span class="hps">unique et</span> <span class="hps">avec les avantages</span> <span class="hps">de</span> <span class="hps">derniers outils</span> <span class="hps">de</span> <span class="hps">Manjaro</span>.</span></span></strong></p>\r\n<p><span class="Quote"><span lang="fr">Infos :&nbsp;<a href="http://www.manjaro.org">http://www.manjaro.org</a></span></span></p>\r\n<p><span class="Quote"><span lang="fr"><img style="display: block; margin-left: auto; margin-right: auto;" src="http://i.ytimg.com/vi/F3uthUzee_s/maxresdefault.jpg" alt="" width="480" height="270" /></span></span></p>', 1552662528, '2015-01-06 20:36:06', 'manjaro-kde-0.8.11-x86_64.iso.torrent', 'Manjaro-logo.png', 261),
(2, 'Manjaro-xfce-0.8.11-x86_64', 'mumbly', 'manjaro-xfce-0-8-11-x86-64', '<p><strong>VERSION XFCE</strong><br /> <strong>Manjaro Linux</strong>, ou tout simplement <strong>Manjaro</strong> (prononc&eacute; comme dans Kilimanjaro), est une distribution Linux utilisant XFCE comme interface utilisateur par d&eacute;faut. C''est d''abord un syst&egrave;me d''exploitation libre pour ordinateurs personnels qui sait rester simple d''utilisation tout en mettant &agrave; disposition la richesse de la communaut&eacute; Arch Linux. Il utilise par ailleurs un mod&egrave;le de d&eacute;veloppement similaire &agrave; sa grande s&oelig;ur, de type <em>rolling release</em>.</p>', '<p><span class="Quote">We are happy to announce the final release of Manjaro Linux 0.8.11. The Xfce edition remains our flagship offering and has received the attention it deserves. Few can claim to offer such a polished, integrated and leading-edge Xfce experience. We ship components from the Xfce 4.11 series after having tested them in-house, ensuring suitability for everyday use. This edition now uses LightDM for login management, display locking and user switching, including custom integration for Xfce. Spearheaded by the Turkish Manjaro community, our KDE edition continues to deliver this powerful, mature and feature-rich desktop environment with a unique look-and-feel and with the perks of Manjaro''s latest tools.</span></p>\r\n<p><span class="Quote"><span id="result_box" lang="fr"><span class="hps">Nous</span> <span class="hps">sommes heureux d''annoncer</span> <span class="hps">la version finale de</span> <span class="hps">Linux</span> <span class="hps">0.8.11</span> <span class="hps">Manjaro</span>. <span class="hps">L''&eacute;dition</span> <span class="hps">Xfce</span> <span class="hps">reste</span> <span class="hps">notre offre</span> <span class="hps">phare</span> <span class="hps">et</span> <span class="hps">a re&ccedil;u</span> <span class="hps">l''attention qu''elle m&eacute;rite</span>. <span class="hps">Peu de gens peuvent</span> <span class="hps">pr&eacute;tendre offrir</span> <span class="hps">une exp&eacute;rience</span> <span class="hps">Xfce</span> <span class="hps">polie,</span> <span class="hps">int&eacute;gr&eacute;e et</span> <span class="hps">de pointe</span>. <span class="hps">Nous exp&eacute;dions</span> les <span class="hps">composants</span> <span class="hps">de la s&eacute;rie</span> <span class="hps">Xfce</span> <span class="hps">4.11</span> <span class="hps">apr&egrave;s les avoir</span> <span class="hps">test&eacute; en interne</span>, <span class="hps">assurer</span> <span class="hps">l''ad&eacute;quation</span> <span class="hps">pour un usage quotidien</span>. <span class="hps">Cette &eacute;dition</span> <span class="hps">utilise maintenant</span> <span class="hps">LightDM</span> <span class="hps">pour la gestion</span> <span class="hps">de la connexion</span>, du verrouillage <span class="hps">de l''&eacute;cran et</span> du<span class="hps"> changement d''utilisateur</span>, <span class="hps">y compris l''int&eacute;gration</span> <span class="hps">personnalis&eacute;e pour</span> <span class="hps">Xfce</span>.</span></span></p>\r\n<p><span class="Quote"><span lang="fr">Infos :&nbsp;<a href="http://www.manjaro.org">http://www.manjaro.org</a></span></span></p>\r\n<p><span class="Quote"><span lang="fr"><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/manjaro-small.png" alt="" width="480" height="384" /></span></span></p>', 1443938304, '2015-01-06 20:51:52', 'manjaro-xfce-0.8.11-x86_64.iso.torrent', 'Manjaro-logo.png', 550),
(3, 'FreeBSD-10.1-amd64-bootonly', 'olivier', 'freebsd-10-1-amd64-bootonly', '<p><strong>FreeBSD</strong> est un syst&egrave;me d''exploitation Unix libre Le nom vient de l''association d''une part de free qui signifie &agrave; la fois &laquo;&nbsp;libre&nbsp;&raquo; et &laquo;&nbsp;gratuit&nbsp;&raquo; dans l''anglais courant, et d''autre part de Berkeley software distribution (BSD), l''UNIX d&eacute;velopp&eacute; &agrave; l''universit&eacute; de Berkeley. L''objectif du projet FreeBSD est de fournir un syst&egrave;me qui puisse servir &agrave; tout, avec le moins de restrictions possibles.</p>', '<p>Un peu moins de deux mois apr&egrave;s une premi&egrave;re version b&ecirc;ta, la version finale de <strong>FreeBSD 10.1</strong> vient enfin de voir le jour. Comme on peut s&rsquo;y attendre, cette nouvelle version du syst&egrave;me d&rsquo;exploitation apporte de nombreuses am&eacute;liorations &ndash; et corrections de bugs et vuln&eacute;rabilit&eacute;s - par rapport &agrave; FreeBSD 10.0.</p>\r\n<p>Parmi les nouveaut&eacute;s, on notera par exemple l&rsquo;ajout du mode VT &agrave; la console, la possibilit&eacute; pour l&rsquo;hyperviseur bhyve de d&eacute;marrer sur un syst&egrave;me de fichier zfs, la possibilit&eacute; de d&eacute;marrer un syst&egrave;me AMD64 via l&rsquo;UEFI, l&rsquo;ajout du protocole UDL-Lite aux piles IPv4 et IPv6, la mise &agrave; jour d&rsquo;OpenSSH en version 6.6p1 et d&rsquo;OpenSSL en version 1.0.1j ou encore le support du SMP pour les kernels armv6.</p>\r\n<p>La <a href="https://www.freebsd.org/releases/10.1R/relnotes.html">liste compl&egrave;te des nouveaut&eacute;s de FreeBSD 10.1 est disponible ici</a>. Pour le t&eacute;l&eacute;chargement de cette distribution (en versions i386, amd64, ia64, powerpc, powerpc64, sparc64 ou arm), <a href="https://www.freebsd.org/where.html">c&rsquo;est par l&agrave; que &ccedil;a se passe</a>.</p>\r\n<p>Infos :&nbsp;<a href="http://www.freebsd.org">http://www.freebsd.org</a></p>', 229355520, '2015-01-07 09:59:57', 'FreeBSD-10.1-RELEASE-amd64-bootonly.iso.torrent', 'freebsd-logo-150x150.png', 269),
(4, 'Fedora-Live-Workstation-x86_64-21-5', 'mumbly', 'fedora-live-workstation-x86-64-21-5', '<p><em><strong>Fedora</strong></em>, anciennement <em><strong>Fedora Core</strong></em>, est une distribution Gnu/Linux b&acirc;tie sur le syst&egrave;me RPM, d&eacute;velopp&eacute;e par le Projet Fedora et soutenue par la soci&eacute;t&eacute; Red Hat. Cette distribution se veut &ecirc;tre un syst&egrave;me d''exploitation complet et g&eacute;n&eacute;raliste, compos&eacute; uniquement de logiciels libres. Fedora d&eacute;rive donc de la distribution Red Hat Linux, et est destin&eacute;e &agrave; la remplacer pour les utilisateurs finaux (utilisation non commerciale).</p>', '<p>Fedora 21 est officiellement sorti ce 9 d&eacute;cembre. Un an apr&egrave;s la sortie de Fedora 20 et en passant par de nombreux changements cette ann&eacute;e avec l&rsquo;initiative Fedora.Next (et en passant par de multiples retards dans la livraison F21), Fedora 21 voit enfin le jour. Fedora 21 comporte tous les derniers logiciels GNOME 3.14, est propuls&eacute; par le noyau Linux 3.17 et dispose d&rsquo;une tonne d&rsquo;autres am&eacute;liorations et modifications, comme d&eacute;j&agrave; indiqu&eacute;. Les utilisateurs de Fedora 21 server ont &eacute;galement des am&eacute;liorations pour le Docker, des am&eacute;liorations du cloud computing et la nouvelle <a href="http://www.phoronix.com/vr.php?view=21226" target="_blank">console Cockpit</a>. Pour en savoir plus consulter<a href="https://lists.fedoraproject.org/pipermail/devel-announce/2014-December/001473.html" target="_blank">&nbsp;l&rsquo;annonce de lib&eacute;ration</a> et le <a href="http://www.redhat.com/en/about/press-releases/fedora-21-now-available-delivers-flexibility-fedoranext" target="_blank">communiqu&eacute; de Red Hat</a>. <a href="http://fedoraproject.org/get-fedora" target="_blank">T&eacute;l&eacute;chargement</a>. Source : phoronix.</p>\r\n<p>Infos :&nbsp;<a href="http://www.fedora-fr.org/">http://www.fedora-fr.org/</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/fedora-small.png" alt="" width="480" height="384" /></p>', 1472200704, '2015-01-07 17:35:28', 'Fedora-Live-Workstation-x86_64-21-5.iso.torrent', 'fedora-logo.jpg', 1682),
(5, 'Linux-Lite-2.2-32bit', 'mumbly', 'linux-lite-2-2-32bit', '<p>Le but de Linux Lite est d''introduire les utilisateurs de Windows &agrave; Linux, et est con&ccedil;u pour &ecirc;tre simple et adapt&eacute; aux nouveaux utilisateurs de Linux qui veulent un environnement l&eacute;ger et pleinement fonctionnelle.</p>', '<p>Linux Lite 2.2 finale est maintenant disponible pour t&eacute;l&eacute;chargement. Cette version est un produit des incroyables contributions &agrave; la fois de la communaut&eacute; et les d&eacute;veloppeurs. Nous avons ajout&eacute; des sauvegardes, un utilitaire de sauvegarde tr&egrave;s simple &agrave; utiliser, date et heure, recherche de fichiers et nos nouveaux membres &agrave; la famille de logiciels Linux Lite &ndash; Lite Cleaner, un nettoyeur de syst&egrave;me pointez et cliquez facile &agrave; utiliser et Lite welcome (Bienvenue) qui vous accueille au premier d&eacute;marrage, donne des informations utiles sur Linux Lite, y compris les mises &agrave; jour, le soutien et le d&eacute;veloppement. Nous avons &eacute;galement ajout&eacute; Light Locker comme nouveau verrouillage d&rsquo;&eacute;cran par des applications suppl&eacute;mentaires, vous permettant de choisir plusieurs programmes &agrave; la fois &agrave; installer. Il est &eacute;galement testeur de m&eacute;dia d&rsquo;installation qui a &eacute;t&eacute; ajout&eacute; au menu du d&eacute;marrage en live.</p>\r\n<p>Infos :&nbsp;<a href="http://www.linuxliteos.com/">http://www.linuxliteos.com/</a></p>', 772800512, '2015-01-07 17:53:08', 'linux-lite-2.2-32bit.iso.torrent', 'linuxlite_square_sticker.jpg', 356),
(6, 'Linuxmint-17.1-cinnamon-64bit', 'mumbly', 'linuxmint-17-1-cinnamon-64bit', '<p><strong>Linux Mint</strong> est un syst&egrave;me d''exploitation Gnu/Linux bas&eacute; sur Ubuntu, et con&ccedil;u pour les ordinateurs individuels au m&ecirc;me titre que Windows ou Mac OS. Il s''affirme comme un &laquo;&nbsp;syst&egrave;me moderne, &eacute;l&eacute;gant et confortable. &Agrave; la fois puissant et facile d''utilisation&nbsp;&raquo;. Linux Mint est la distribution Linux la plus t&eacute;l&eacute;charg&eacute;e et le <abbr class="abbr" title="Troisi&egrave;me">3<sup>e</sup></abbr> syst&egrave;me d''exploitation le plus utilis&eacute; au monde. La particularit&eacute; du syst&egrave;me r&eacute;side dans le fait qu''il est gratuit, et inclut par d&eacute;faut des logiciels libres et non-libres. La devise de la distribution est &laquo;&nbsp;<em>From freedom came elegance</em>&nbsp;&raquo;, ce qu''on peut adapter en fran&ccedil;ais par&nbsp;: &laquo;&nbsp;De la libert&eacute; naquit l''&eacute;l&eacute;gance&nbsp;&raquo;. Linux Mint b&eacute;n&eacute;ficie de mises &agrave; jour majeures tous les six mois ainsi que d''une nouvelle version tous les deux ans. La derni&egrave;re version, sortie le 29 novembre 2014, se nomme "Linux Mint 17.1 Rebecca". Elle sera support&eacute;e jusqu''en avril 2019.</p>', '<p>L&rsquo;&eacute;quipe est fi&egrave;re d&rsquo;annoncer la sortie de Linux Mint 17.1 MATE &lsquo;Rebecca&rsquo;. Linux Mint 17.1 est une sortie LTS qui sera soutenue jusqu&rsquo;en 2019. Elle est livr&eacute;e avec les logiciels mis &agrave; jour et apporte des am&eacute;liorations et de nombreuses nouvelles fonctionnalit&eacute;s pour rendre votre bureau plus confortable &agrave; utiliser. Linux Mint 17.1 &eacute;dition MATE est livr&eacute;e avec deux gestionnaires de fen&ecirc;tres install&eacute;s et configur&eacute;s par d&eacute;faut : Marco (tr&egrave;s propre gestionnaire de fen&ecirc;tres de MATE, simple, rapide et tr&egrave;s stable) ; Compiz (un Compositeur avanc&eacute; qui peut faire des merveilles si votre mat&eacute;riel le supporte). Parmi les diff&eacute;rents gestionnaires de fen&ecirc;tres disponibles pour Linux, Compiz est certainement le plus impressionnant quand il s&rsquo;agit des effets de bureau...</p>\r\n<p>Infos :&nbsp;<a href="http://www.linuxmint.com/">http://www.linuxmint.com/</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/mint-small.png" alt="" width="480" height="384" /></p>', 1549615104, '2015-01-07 19:16:55', 'linuxmint-17.1-cinnamon-64bit.iso.torrent', 'mintlogo2.jpg', 404),
(7, 'Deepin-2014-2-amd64', 'mumbly', 'deepin-2014-2-amd64', '<p>Ubuntu 13.10 est la base de <strong>Linux Deepin</strong>, une distribution avec un<strong> environnement de bureau GNOME mais avec une un environnement de bureau appel&eacute; Deepin Desktop</strong> construit en WebKit et HTML 5 qui conserve des aspects de Gnome comme le<strong> lanceur d''applications GNOME Shell et qui contient un </strong><em><strong>dock</strong></em>. Il est <strong>&eacute;quip&eacute; d&rsquo;int&eacute;ressantes applications propres</strong> comme le centre de software ou l''application de lecture audio Dmusic qui propose un lecteur efficace.</p>', '<h3>Caract&eacute;ristiques</h3>\r\n<ul>\r\n<li>D&eacute;veloppement<strong> bas&eacute; sur Ubuntu 13.10</strong>.</li>\r\n<li><strong>Environnement de bureau GNOME</strong>.</li>\r\n<li><strong>Utilit&eacute;s propres </strong>pour la gestion de software, lecture de musique, captures d''&eacute;cran, traducteur, terminal et centre de jeux.</li>\r\n<li><strong>Grand paquet d''applications</strong> comme les navigateurs Firefox et Chromium, la suite bureautique LibreOffice, le gestionnaire de messagerie Thunderbird, le lecteur multim&eacute;dia VLC ou les outils de gestion de base de donn&eacute;es MySQL et PostgreSQL.</li>\r\n</ul>\r\n<p><strong>Linux Deepin</strong> est une bonne option pour tous ceux qui veuillent profiter d''une distribution de Linux avec un design agr&eacute;able, une pr&eacute;sentation soign&eacute;e et une bonne s&eacute;lection de software.</p>\r\n<p>Infos :&nbsp;<a href="http://www.linuxdeepin.com/index.en.html">http://www.linuxdeepin.com/index.en.html</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/deepin-small.png" alt="" width="480" height="300" /></p>', 1979711488, '2015-01-08 07:01:13', 'deepin_2014.2_amd64.iso.torrent', 'deepin-logojpg.jpg', 936),
(9, 'PCBSD-10.1-x64-DVD', 'mumbly', 'pcbsd-10-1-x64-dvd', '<p><strong>PC-BSD</strong>&nbsp;est un&nbsp;syst&egrave;me d''exploitation&nbsp;bas&eacute; sur&nbsp;FreeBSD. Malgr&eacute; sa robustesse, FreeBSD est consid&eacute;r&eacute; comme difficile &agrave; ma&icirc;triser par les utilisateurs d''autres syst&egrave;mes. Le but du projet PC-BSD est de fournir une distribution bas&eacute;e sur FreeBSD, mais n&eacute;anmoins plus accessible &agrave; des utilisateurs moyens.<br /> PC-BSD n''est pas une version d&eacute;riv&eacute;e (<em>fork</em>) de FreeBSD. Il se pr&eacute;sente plut&ocirc;t comme une couche suppl&eacute;mentaire, permettant d''installer facilement un environnement bureautique&nbsp;pr&ecirc;t &agrave; l''emploi. Il est disponible sur la plateforme&nbsp;AMD64&nbsp;uniquement.</p>', '<p>L''installation se fait en mode graphique, proposant l''environnement&nbsp;<a title="KDE" href="http://fr.wikipedia.org/wiki/KDE">KDE</a>&nbsp;par d&eacute;faut. PC-BSD poss&egrave;de son propre syst&egrave;me de paquetages, les PBI. L''installation et la d&eacute;sinstallation des&nbsp;<a title="PC-BSD Installer" href="http://fr.wikipedia.org/wiki/PC-BSD_Installer">PC-BSD Installer</a>&nbsp;sont simplifi&eacute;es, car elles suppriment la notion de d&eacute;pendance entre paquets&nbsp;; les biblioth&egrave;ques n&eacute;cessaires &agrave; l''ex&eacute;cution d''un programme sont int&eacute;gr&eacute;es directement dans le paquetage. N&eacute;anmoins, il est toujours possible d''installer les logiciels par l''interm&eacute;diaire des&nbsp;<a title="FreeBSD" href="http://fr.wikipedia.org/wiki/FreeBSD#Les_.C2.AB_ports_.C2.BB">ports</a>&nbsp;&agrave; la mani&egrave;re de FreeBSD.</p>\r\n<p>Le syst&egrave;me est maintenant pleinement fonctionnel. Les versions de PC-BSD sont synchronis&eacute;es avec celles de FreeBSD.</p>\r\n<p>Infos :&nbsp;<a href="http://www.pcbsd.org/fr/">http://www.pcbsd.org/fr/</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/pcbsd-small.png" alt="" width="480" height="384" /></p>', 3579359232, '2015-01-08 10:49:28', 'PCBSD10.1-RELEASE-11-14-2014-x64-DVD-USB.iso.torrent', 'pcbsd-logo.png', 315),
(10, 'Manjaro-gnome-0.8.11-x86_64', 'mumbly', 'manjaro-gnome-0-8-11-x86-64', '<p><strong>VERSION GNOME 3.14 Community Edition&nbsp;- Manjaro Linux</strong>, ou tout simplement&nbsp;<strong>Manjaro</strong>&nbsp;(prononc&eacute; comme dans kilimanjaro), est une distribution Linux tilisant XFCE comme interface utilisateur par d&eacute;faut. C''est d''abord un syst&egrave;me d''exploitation libre pour ordinateurs personnels qui sait rester simple d''utilisation tout en mettant &agrave; disposition la richesse de la communaut&eacute;&nbsp;<a title="Arch Linux" href="http://fr.wikipedia.org/wiki/Arch_Linux">Arch Linux</a>. Il utilise par ailleurs un mod&egrave;le de d&eacute;veloppement similaire &agrave; sa grande s&oelig;ur, de type&nbsp;<em><a title="Rolling release" href="http://fr.wikipedia.org/wiki/Rolling_release">rolling release</a></em>.</p>', '<p>Cette &eacute;dition fournit Gnome 3.14 dans un &eacute;tat assez basic (Vanilla) avec seulement les outils de base de Manjaro.</p>\r\n<p><strong>Manjaro Linux</strong>, ou tout simplement&nbsp;<strong>Manjaro</strong>&nbsp;(prononc&eacute; comme dans<a class="mw-redirect" title="Kilimanjaro" href="http://fr.wikipedia.org/wiki/Kilimanjaro">Kilimanjaro</a>), est une&nbsp;<a title="Distribution Linux" href="http://fr.wikipedia.org/wiki/Distribution_Linux">distribution Linux</a>&nbsp;utilisant&nbsp;<a class="mw-redirect" title="XFCE" href="http://fr.wikipedia.org/wiki/XFCE">XFCE</a>&nbsp;comme interface utilisateur par d&eacute;faut. C''est d''abord un&nbsp;<a title="Syst&egrave;me d''exploitation" href="http://fr.wikipedia.org/wiki/Syst%C3%A8me_d%27exploitation">syst&egrave;me d''exploitation</a>&nbsp;<a title="Logiciel libre" href="http://fr.wikipedia.org/wiki/Logiciel_libre">libre</a>&nbsp;pour ordinateurs personnels qui sait rester simple d''utilisation tout en mettant &agrave; disposition la richesse de la communaut&eacute;&nbsp;<a title="Arch Linux" href="http://fr.wikipedia.org/wiki/Arch_Linux">Arch Linux</a>. Il utilise par ailleurs un mod&egrave;le de d&eacute;veloppement similaire &agrave; sa grande s&oelig;ur, de type&nbsp;<em><a title="Rolling release" href="http://fr.wikipedia.org/wiki/Rolling_release">rolling release</a></em>.</p>\r\n<p>Infos :&nbsp;<a href="http://manjaro.github.io/Manjaro-Gnome-0.8.11-community-edition-released/">http://manjaro.github.io/Manjaro-Gnome-0.8.11-community-edition-released/</a></p>', 1729495040, '2015-01-08 15:18:50', 'manjaro-gnome-0.8.11-x86_64.iso.torrent', 'Manjaro-logo.png', 403),
(11, 'Ubuntu-14.10-desktop-amd64', 'mumbly', 'ubuntu-14-10-desktop-amd64', '<p><strong>Ubuntu</strong> est un syst&egrave;me d''exploitation libre commandit&eacute; par la soci&eacute;t&eacute; Canonical et une marque d&eacute;pos&eacute;e par cette m&ecirc;me soci&eacute;t&eacute;. Fond&eacute; sur la distribution Linux Debian, ce syst&egrave;me d''exploitation est constitu&eacute; de logiciels libres et est disponible gratuitement, y compris pour les entreprises, selon un principe li&eacute; &agrave; la philosophie affich&eacute;e du projet. On estime en 2011 qu''il y a plus de 25 millions d''utilisateurs des diff&eacute;rentes versions pour ordinateurs.</p>', '<p>Sortie le 23 octobre 2014, Ubuntu 14.10 est la vingt-et-uni&egrave;me version d&rsquo;Ubuntu. Son nom de code est <em>Utopic Unicorn</em>, soit &laquo;â€¯licorne utopiqueâ€¯&raquo; dans la langue de Moli&egrave;re.</p>\r\n<p>Pour rappel, Ubuntu est une distribution GNU/Linux bas&eacute;e sur Debian, et d&eacute;clin&eacute;e en plusieurs variantes selon l''environnement de bureau utilis&eacute;e (GNOME, KDE, etc) et la cible vis&eacute;e (serveurs, studio de son, ou encore pour les mobiles et tablettes &agrave; venir, etc). Soutenue par Canonical, et apr&egrave;s un succ&egrave;s sur les sentiers battus, les d&eacute;cisions quant aux choix techniques des prochaines d&eacute;clinaisons d''Ubuntu font souvent parler d''elle, en bien (notamment l''ergonomie) comme en mal (tel que le choix des licences pour les projets internes).</p>\r\n<p>Pour autant, cons&eacute;quence directe des ambitions pour l''Ubuntu 15.04 qui sortira dans six mois, les modifications &agrave; l''ordre du jour sont assez courtes. Cette sortie de la nouvelle version d''Ubuntu refl&egrave;te donc un syndrome d&eacute;j&agrave; vu pour d''autres distributions : dans l''ensemble, on met &agrave; jour les m&ecirc;mes composants que les autres, et on change quelques ressources graphiques.</p>\r\n<p>Fort heureusement, si cette 14.10 est faible en modifications sp&eacute;cifiques &agrave; Ubuntu, la 15.04 s''annonce d&eacute;j&agrave; plus int&eacute;ressante.</p>\r\n<p>Infos :&nbsp;<a href="http://www.ubuntu-fr.org">http://www.ubuntu-fr.org</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/ubuntu-small.png" alt="" width="480" height="384" /></p>', 1162936320, '2015-01-09 13:19:39', 'ubuntu-14.10-desktop-amd64.iso.torrent', 'ubuntu-logo.jpg', 300),
(12, 'Voyager 7 amd64', 'mumbly', 'voyager-7-amd64', '<p>Nouveau live&nbsp;Voyager 7&nbsp;bas&eacute; sur Debian&nbsp;wheezy 7.3&nbsp;et son bureau&nbsp;XFCE. Une personnalisation compl&egrave;te de&nbsp;985 mo<strong>.&nbsp;</strong>Une distribution&nbsp;GNU/Linux&nbsp;libre et gratuite. Vous pouvez graver Voyager sur DVD ou l&rsquo;installer sur une cl&eacute; USB.</p>', '<p>Voyager est une distribution traditionnellement bas&eacute;e sur Xubuntu, avec l''environnement de bureau Xfce. Ses caract&eacute;ristiques comprennent le navigateur Avant Window ou AWN (une barre de navigation dock-like), Conky (un programme qui affiche des informations utiles sur le bureau), et plus de 300 photographies et des animations qui peuvent &ecirc;tre utilis&eacute;s comme fonds d''&eacute;cran...</p>\r\n<p>Plus d''info sur :&nbsp;<a href="http://voyagerlive.org/index.php/live-voyager-7-debian-wheezy/">http://voyagerlive.org/index.php/live-voyager-7-debian-wheezy/</a></p>', 1032847360, '2015-01-09 16:13:52', 'Voyager-7-amd64-desktop.iso.torrent', 'voyager.png', 331),
(14, 'Sparkylinux-3.6-x86_64-XFCE', 'olivier', 'sparkylinux-3-6-x86-64-xfce', '<p>Sparkylinux est une distribution l&eacute;g&egrave;re, rapide et simple qui prose les bureaux Enlightenment etLXDE. Elle est bas&eacute;e sur Debian testing. Cette distribution "Live-CD" propose plusieurs plugins et une s&eacute;lection d''applications multim&eacute;dia.</p>', '<p>The SparkyLinux project follows a rolling-release model based on the stable Debian branch, has five different desktop environments, supports most wireless and wired network cards, includes support for English and Polish languages, and it is easily installable on disk drives or USB sticks. In addition, the operating system includes Lite (JWM), Xfce, LXDE, MATE, Razor-Qt, CLI, Trinity, Ultra, and GameOver editions, which can all be downloaded from Softpedia.</p>\r\n<p>SparkyLinux E17 is distributed as Live DVD ISO images, one for each of the supported hardware platforms (32-bit and 64-bit), designed to be installed on a local disk drive.</p>\r\n<p>Infos :&nbsp;<a href="http://sparkylinux.org/">http://sparkylinux.org/</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/sparky-small.png" alt="" width="480" height="360" /></p>', 1574961152, '2015-01-09 22:36:21', 'sparkylinux-3.6-x86_64-xfce.iso.torrent', 'sparky-logo.jpg', 351),
(15, 'Debian-7.7.0-amd64-DVD', 'mumbly', 'debian-7-7-0-amd64-dvd', '<p>Debian est un syst&egrave;me d''exploitation libre pour votre ordinateur. Un syst&egrave;me d''exploitation est la suite des programmes de base et des utilitaires qui permettent &agrave; un ordinateur de fonctionner.<br /> Les syst&egrave;mes Debian utilisent actuellement le noyau Linux ou le noyau FreeBSD. Linux est un logiciel initi&eacute; par Linus Torvalds et d&eacute;velopp&eacute; par des milliers de programmeurs de par le monde. FreeBSD est un syst&egrave;me d''exploitation comprenant un noyau et d''autres logiciels.<br /> Cependant, un travail est en cours pour donner d''autres noyaux &agrave; Debian, principalement . Hurd est une collection de serveurs qui fonctionnent au-dessus d''un micronoyau (tel que Mach) pour impl&eacute;menter diff&eacute;rentes fonctionnalit&eacute;s. Hurd est un logiciel libre produit par le projet GNU.<br /> Une grande partie des utilitaires de base qui constituent le syst&egrave;me d''exploitation vient du projet GNU&nbsp;; d''o&ugrave; les noms&nbsp;: GNU/Linux, GNU/kFreeBSD et GNU/Hurd. Ces utilitaires sont libres eux aussi.</p>', '<p><strong>Debian</strong> (/<span class="API" style="font-family: ''DejaVu Sans'',''Doulos SIL'',''Lucida Grande'',''Segoe UI'',''Arial Unicode MS'',''Adobe Pi Std'',''Lucida Sans Unicode'',''Chrysanthi Unicode'',Code2000,Gentium,GentiumAlt,''TITUS Cyberbit Basic'',''Bitstream Vera Sans'',''Bitstream Cyberbit'',''Hiragino Kaku Gothic Pro'',''Matrix Unicode'',sans-serif;" title="Alphabet phon&eacute;tique international"><a title="Alphabet phon&eacute;tique international" href="http://fr.wikipedia.org/wiki/Alphabet_phon%C3%A9tique_international"><span class="API" style="font-family: ''DejaVu Sans'',''Doulos SIL'',''Lucida Grande'',''Segoe UI'',''Arial Unicode MS'',''Adobe Pi Std'',''Lucida Sans Unicode'',''Chrysanthi Unicode'',Code2000,Gentium,GentiumAlt,''TITUS Cyberbit Basic'',''Bitstream Vera Sans'',''Bitstream Cyberbit'',''Hiragino Kaku Gothic Pro'',''Matrix Unicode'',sans-serif;">de.bjan</span></a></span>/) est une organisation communautaire et d&eacute;mocratique, dont le but est le d&eacute;veloppement de <a title="Syst&egrave;me d''exploitation" href="http://fr.wikipedia.org/wiki/Syst%C3%A8me_d%27exploitation">syst&egrave;mes d''exploitation</a> bas&eacute;s exclusivement sur des <a title="Logiciel libre" href="http://fr.wikipedia.org/wiki/Logiciel_libre">logiciels libres</a>.</p>\r\n<p>Chaque syst&egrave;me, lui-m&ecirc;me nomm&eacute; Debian, r&eacute;unit autour d''un <a title="Noyau de syst&egrave;me d''exploitation" href="http://fr.wikipedia.org/wiki/Noyau_de_syst%C3%A8me_d%27exploitation">noyau de syst&egrave;me d''exploitation</a> de nombreux &eacute;l&eacute;ments pouvant &ecirc;tre d&eacute;velopp&eacute;s ind&eacute;pendamment les uns des autres, pour plusieurs <a class="mw-redirect" title="Architecture informatique" href="http://fr.wikipedia.org/wiki/Architecture_informatique">architectures</a> mat&eacute;rielles. Ces &eacute;l&eacute;ments, programmes de base compl&eacute;tant le noyau et logiciels applicatifs, se pr&eacute;sentent sous forme de &laquo;&nbsp;paquets&nbsp;&raquo; qui peuvent &ecirc;tre install&eacute;s en fonction des besoins (paragraphe <a title="Debian" href="http://fr.wikipedia.org/wiki/Debian#Distribution_des_logiciels">Distribution des logiciels</a>). L''ensemble syst&egrave;me d''exploitation plus logiciels s''appelle une distribution.</p>\r\n<p>On assimile g&eacute;n&eacute;ralement ces syst&egrave;mes d''exploitation au syst&egrave;me <strong>Debian GNU/Linux</strong>, la <a title="GNU/Linux" href="http://fr.wikipedia.org/wiki/GNU/Linux">distribution GNU/Linux</a> de Debian, car jusqu''en 2009 c''&eacute;tait la seule branche parfaitement fonctionnelle. Mais d''autres distributions Debian sont en cours de d&eacute;veloppement en 2013&nbsp;: <a title="Debian GNU/Hurd" href="http://fr.wikipedia.org/wiki/Debian_GNU/Hurd">Debian GNU/Hurd</a> et <a title="Debian GNU/kFreeBSD" href="http://fr.wikipedia.org/wiki/Debian_GNU/kFreeBSD">Debian GNU/kFreeBSD</a>. La version Debian &laquo;&nbsp;Squeeze&nbsp;&raquo; est la premi&egrave;re &agrave; &ecirc;tre distribu&eacute;e avec le noyau kFreeBSD en plus du noyau Linux.</p>\r\n<p>Debian est utilis&eacute;e comme base de nombreuses autres distributions comme <a title="Knoppix" href="http://fr.wikipedia.org/wiki/Knoppix">Knoppix</a> ou <a title="Ubuntu" href="http://fr.wikipedia.org/wiki/Ubuntu">Ubuntu</a> qui rencontrent un grand succ&egrave;s.</p>\r\n<p>Fin <a title="2005" href="http://fr.wikipedia.org/wiki/2005">2005</a>, la distribution Debian a &eacute;t&eacute; retenue par la ville de <a title="Munich" href="http://fr.wikipedia.org/wiki/Munich">Munich</a> pour &eacute;quiper les quelque 14&nbsp;000 ordinateurs de type <a title="Compatible PC" href="http://fr.wikipedia.org/wiki/Compatible_PC">PC</a> qui formaient alors son parc informatique.</p>', 3942645760, '2015-01-10 08:32:42', 'debian-7.7.0-amd64-DVD-1.iso.torrent', 'debian-square-150x150.png', 404),
(16, 'Debian-testing-amd64-DVD', 'mumbly', 'debian-testing-amd64-dvd', '<p>Le nom de code de la prochaine version majeure de Debian apr&egrave;s est Jessie.<br /> Cette version a &eacute;t&eacute; initialis&eacute;e &agrave; partir d''une copie de Wheezy, et se trouve pour l''instant dans une phase dite <q>de test</q>. Cela signifie que vous ne devriez pas souffrir des m&ecirc;mes probl&egrave;mes qu''avec les distributions instable ou exp&eacute;rimentale, car les paquets n''entrent dans cette distribution qu''apr&egrave;s une certaine p&eacute;riode de test, et s''ils n''ont pas de bogues critiques.</p>', '<p><a href="https://www.debian.org/">Debian</a> est un syst&egrave;me d''exploitation <a href="https://www.debian.org/intro/free">libre</a> pour votre ordinateur. Un syst&egrave;me d''exploitation est la suite des programmes de base et des utilitaires qui permettent &agrave; un ordinateur de fonctionner.</p>\r\n<p>Les syst&egrave;mes Debian utilisent actuellement le noyau <a href="https://www.kernel.org/">Linux</a> ou le noyau <a href="http://www.freebsd.org/">FreeBSD</a>. Linux est un logiciel initi&eacute; par <a href="https://en.wikipedia.org/wiki/Linus_Torvalds">Linus Torvalds</a> et d&eacute;velopp&eacute; par des milliers de programmeurs de par le monde. FreeBSD est un syst&egrave;me d''exploitation comprenant un noyau et d''autres logiciels.</p>\r\n<p>Cependant, un travail est en cours pour donner d''autres noyaux &agrave; Debian, principalement <a href="http://www.gnu.org/software/hurd/hurd.html">Hurd</a>. Hurd est une collection de serveurs qui fonctionnent au-dessus d''un micronoyau (tel que Mach) pour impl&eacute;menter diff&eacute;rentes fonctionnalit&eacute;s. Hurd est un logiciel libre produit par le <a href="http://www.gnu.org/">projet GNU</a>.</p>\r\n<p>Une grande partie des utilitaires de base qui constituent le syst&egrave;me d''exploitation vient du <a href="http://www.gnu.org/">projet GNU</a>&nbsp;; d''o&ugrave; les noms&nbsp;: GNU/Linux, GNU/kFreeBSD et GNU/Hurd. Ces utilitaires sont libres eux aussi.</p>\r\n<p>Infos : <a href="http://www.debian.org">http://www.debian.org</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/debian-small.png" alt="" width="480" height="384" /></p>', 3976200192, '2015-01-10 08:49:48', 'debian-testing-amd64-DVD-1.iso.torrent', 'debian-square-150x150.png', 401),
(17, 'Siduction-14.1.0-XFCE-amd64', 'mumbly', 'siduction-14-1-0-xfce-amd64', '<p>Version IndianSummer de la siduction du 23/11/2014 pour architecture 64 bits.<br /> Pour 2014, il y a juste cette version finale siduction 2014.1 exp&eacute;di&eacute;e avec six environnements de bureau -.. KDE SC, Xfce, LXDE, LXQt, GNOME et Cinnamon, le tout dans des variantes 32 bits et 64 bits.</p>', '<p><span id="result_box" lang="fr"><span class="hps">La distribution</span> <span class="hps">de</span> <span class="hps">siduction</span> <span class="hps">est un syst&egrave;me</span> <span class="hps">d''exploitation orient&eacute;</span> <span class="hps">bureau</span> b<span class="hps">as&eacute; sur</span> <span class="hps">la branche</span> "u<span class="hps">nstable" (SID)</span> <span class="hps">de Debian GNU</span> <span class="hps">/</span> <span class="hps">Linux</span>.</span></p>\r\n<p><span id="result_box" lang="fr"><span class="hps">Fork d''A</span><span class="hps">ptosid</span> <span class="hps">&agrave; la fin de</span> <span class="hps">2011</span>, S<span class="hps">iduction</span> <span class="hps">offre trois</span> <span class="hps">environnement </span><span class="hps">s&eacute;par&eacute;es</span> <span class="hps">avec KDE</span>, <span class="hps">LXDE</span> <span class="hps">et Xfce</span>. <span class="hps">Le projet</span> <span class="hps">promet &eacute;galement</span> des releases r&eacute;guli&egrave;res, <span class="hps">un mod&egrave;le</span> <span class="hps">de d&eacute;veloppement ouvert</span>, <span class="hps">et</span> <span class="hps">des relations amicales avec</span> <span class="hps">son d&eacute;veloppeur</span> <span class="hps">et la communaut&eacute;</span> <span class="hps">des utilisateurs.</span></span></p>\r\n<p><span lang="fr"><span class="hps"><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/siduction-small.png" alt="" width="480" height="384" /></span></span></p>', 900726784, '2015-01-11 08:56:01', 'siduction-14.1.0-indiansummer-xfce-amd64-201411230427.iso.torrent', 'Siduction_logo.svg.png', 311),
(18, 'Manjaro-Net-0.8.11-x86_64', 'mumbly', 'manjaro-net-0-8-11-x86-64', '<p><strong>VERSION Net Edition 64 bits<br /></strong>La NET Edition de Manjaro fournit une installation de base d&eacute;pourvue de gestionnaire d''affichage, d''environnement de bureau, et d''applications de bureau. Toutefois, conform&eacute;ment &agrave; notre philosophie de convivialit&eacute;&nbsp;:</p>\r\n<ul>\r\n<li>Les codecs et les logiciels (par exemple Adobe Flash) n&eacute;cessaires pour lire des fichiers multim&eacute;dias sont pr&eacute;-install&eacute;s&nbsp;;</li>\r\n<li>yaourt est pr&eacute;-install&eacute; pour acc&eacute;der au d&eacute;p&ocirc;t AUR&nbsp;;</li>\r\n<li>Les Additions Invit&eacute; de VirtualBox sont pr&eacute;-install&eacute;s&nbsp;;</li>\r\n<li>Votre mat&eacute;riel est toujours automatiquement d&eacute;tect&eacute;, et</li>\r\n<li>Les pilotes appropri&eacute;s (par exemple pour les cartes graphiques) sont toujours install&eacute;s pour vous.</li>\r\n</ul>\r\n<p>Par cons&eacute;quent, la NET Edition va vous permettre de fa&ccedil;onner votre syst&egrave;me <em>exactement</em> comme vous le souhaitez, avec <em>exactement</em> les applications logicielles que vous voulez, mais sans la perte de temps, la difficult&eacute;, l''expertise technique qui seraient sinon n&eacute;cessaires pour installer les pilotes mat&eacute;riels, les codecs, etc. <strong>Ceci va rendre l''installation de la NET Edition accessible m&ecirc;me aux d&eacute;butants</strong>, et peut offrir une merveilleuse opportunit&eacute; de construire votre propre syst&egrave;me et d''apprendre durant le processus comment il fonctionne.</p>', '<p><strong>Manjaro Linux</strong>, ou tout simplement&nbsp;<strong>Manjaro</strong>&nbsp;(prononc&eacute; comme dans<a class="mw-redirect" title="Kilimanjaro" href="http://fr.wikipedia.org/wiki/Kilimanjaro">Kilimanjaro</a>), est une&nbsp;<a title="Distribution Linux" href="http://fr.wikipedia.org/wiki/Distribution_Linux">distribution Linux</a>&nbsp;utilisant&nbsp;<a class="mw-redirect" title="XFCE" href="http://fr.wikipedia.org/wiki/XFCE">XFCE</a>&nbsp;comme interface utilisateur par d&eacute;faut. C''est d''abord un&nbsp;<a title="Syst&egrave;me d''exploitation" href="http://fr.wikipedia.org/wiki/Syst%C3%A8me_d%27exploitation">syst&egrave;me d''exploitation</a>&nbsp;<a title="Logiciel libre" href="http://fr.wikipedia.org/wiki/Logiciel_libre">libre</a>&nbsp;pour ordinateurs personnels qui sait rester simple d''utilisation tout en mettant &agrave; disposition la richesse de la communaut&eacute;&nbsp;<a title="Arch Linux" href="http://fr.wikipedia.org/wiki/Arch_Linux">Arch Linux</a>. Il utilise par ailleurs un mod&egrave;le de d&eacute;veloppement similaire &agrave; sa grande s&oelig;ur, de type&nbsp;<em><a title="Rolling release" href="http://fr.wikipedia.org/wiki/Rolling_release">rolling release</a></em>.</p>\r\n<p>Infos :&nbsp;<a href="http://manjaro.github.io/Manjaro-Gnome-0.8.11-community-edition-released/">http://manjaro.github.io/Manjaro-Gnome-0.8.11-community-edition-released/</a></p>', 597688320, '2015-01-11 09:12:40', 'manjaro-net-0.8.11-x86_64.iso.torrent', 'Manjaro-logo.png', 271),
(19, 'Manjaro-Net-0.8.11-i686', 'xs3bx', 'manjaro-net-0-8-11-i686', '<p><strong>VERSION Net Edition 32 bits i686<br /></strong>La NET Edition de Manjaro fournit une installation de base d&eacute;pourvue de gestionnaire d''affichage, d''environnement de bureau, et d''applications de bureau. Toutefois, conform&eacute;ment &agrave; notre philosophie de convivialit&eacute;&nbsp;:</p>\r\n<ul>\r\n<li>Les codecs et les logiciels (par exemple Adobe Flash) n&eacute;cessaires pour lire des fichiers multim&eacute;dias sont pr&eacute;-install&eacute;s&nbsp;;</li>\r\n<li>yaourt est pr&eacute;-install&eacute; pour acc&eacute;der au d&eacute;p&ocirc;t AUR&nbsp;;</li>\r\n<li>Les Additions Invit&eacute; de VirtualBox sont pr&eacute;-install&eacute;s&nbsp;;</li>\r\n<li>Votre mat&eacute;riel est toujours automatiquement d&eacute;tect&eacute;, et</li>\r\n<li>Les pilotes appropri&eacute;s (par exemple pour les cartes graphiques) sont toujours install&eacute;s pour vous.</li>\r\n</ul>\r\n<p>Par cons&eacute;quent, la NET Edition va vous permettre de fa&ccedil;onner votre syst&egrave;me <em>exactement</em> comme vous le souhaitez, avec <em>exactement</em> les applications logicielles que vous voulez, mais sans la perte de temps, la difficult&eacute;, l''expertise technique qui seraient sinon n&eacute;cessaires pour installer les pilotes mat&eacute;riels, les codecs, etc. <strong>Ceci va rendre l''installation de la NET Edition accessible m&ecirc;me aux d&eacute;butants</strong>, et peut offrir une merveilleuse opportunit&eacute; de construire votre propre syst&egrave;me et d''apprendre durant le processus comment il fonctionne.</p>', '<p><strong>Manjaro Linux</strong>, ou tout simplement&nbsp;<strong>Manjaro</strong>&nbsp;(prononc&eacute; comme dans<a class="mw-redirect" title="Kilimanjaro" href="http://fr.wikipedia.org/wiki/Kilimanjaro">Kilimanjaro</a>), est une&nbsp;<a title="Distribution Linux" href="http://fr.wikipedia.org/wiki/Distribution_Linux">distribution Linux</a>&nbsp;utilisant&nbsp;<a class="mw-redirect" title="XFCE" href="http://fr.wikipedia.org/wiki/XFCE">XFCE</a>&nbsp;comme interface utilisateur par d&eacute;faut. C''est d''abord un&nbsp;<a title="Syst&egrave;me d''exploitation" href="http://fr.wikipedia.org/wiki/Syst%C3%A8me_d%27exploitation">syst&egrave;me d''exploitation</a>&nbsp;<a title="Logiciel libre" href="http://fr.wikipedia.org/wiki/Logiciel_libre">libre</a>&nbsp;pour ordinateurs personnels qui sait rester simple d''utilisation tout en mettant &agrave; disposition la richesse de la communaut&eacute;&nbsp;<a title="Arch Linux" href="http://fr.wikipedia.org/wiki/Arch_Linux">Arch Linux</a>. Il utilise par ailleurs un mod&egrave;le de d&eacute;veloppement similaire &agrave; sa grande s&oelig;ur, de type&nbsp;<em><a title="Rolling release" href="http://fr.wikipedia.org/wiki/Rolling_release">rolling release</a></em>.</p>\r\n<p>Infos :&nbsp;<a href="http://manjaro.github.io/Manjaro-Gnome-0.8.11-community-edition-released/">http://manjaro.github.io/Manjaro-Gnome-0.8.11-community-edition-released/</a></p>', 471859200, '2015-01-11 14:17:40', 'manjaro-net-0.8.11-i686.torrent', 'Manjaro-logo.png', 401),
(20, 'ChaletOS-14.4-01-2015-all', 'mumbly', 'chaletos-14-4-01-2015-all', '<p>Ce syst&egrave;me n''est pas trop diff&eacute;rent du syst&egrave;me Xubuntu sur qui il est bas&eacute;, mais ChaletOS a un style simple et rapide qui impressionne. En raison de ses faibles besoins en mat&eacute;riel, il fera revivre quelques vieilles machines et rafra&icirc;chir les autres, pas si vieux.<br /> En bref si vous voulez un style proche de Windows 8 ou plus pr&eacute;cis&eacute;ment le futur Windows 10, ce "truc" est pour vous !</p>', '<p>Nous connaissons tous quelqu''un qui a essay&eacute; de passer &agrave; Linux, mais ce n''&eacute;tait pas r&eacute;ussi. Le syst&egrave;me qu''il a essay&eacute; &eacute;tait trop diff&eacute;rent de ce qu''il a toujours utilis&eacute;. Il y avait trop de nouvelles choses et les choses anciennes &eacute;taient ailleurs. Le but de ce projet est de s''habituer &agrave; Linux.</p>\r\n<p>Le nom ChaletOS vient du style des maisons de montagne en Suisse. Le concept de ces maisons est similaire au concept que nous avions alors nous avons fait ce syst&egrave;me: la simplicit&eacute;, la beaut&eacute; et reconnaissable. Puisque nous voulons que les nouveaux utilisateurs se sentent &agrave; la maison, nous nous attendons &agrave; ce syst&egrave;me pour r&eacute;pondre &agrave; cet objectif.</p>\r\n<p>Plus d''infos :&nbsp;<a href="https://sites.google.com/site/chaletoslinux/home">https://sites.google.com/site/chaletoslinux/home</a></p>', 2807480320, '2015-01-12 18:19:04', 'chaletos14.04-jan2015-all.iso.torrent', 'chaletos1.jpg', 814),
(21, 'Netrunner-Rolling-2014-09-1-DVD-64bits', 'mumbly', 'netrunner-rolling-2014-09-1-dvd-64bits', '<p><strong>Netrunner</strong> un syst&egrave;me d''exploitation libre pr&ecirc;t &agrave; l''emploi bas&eacute; sur la distribution GNU/Linux Kubuntu.<br /> Il s''agit ici de la version Rolling Release bas&eacute;e sur Manjaro (elle-m&ecirc;me bas&eacute;e sur ArchLinux). Le bureau est sous KDE 4.14 et le noyau est un un 3.14.18 Manjaro.</p>', '<p>Blue Systems, la soci&eacute;t&eacute; qui sponsorise &eacute;galement la version KDE de <a title="Linux Mint" href="http://fr.wikipedia.org/wiki/Linux_Mint">Linux Mint</a> et <a title="Kubuntu" href="http://fr.wikipedia.org/wiki/Kubuntu">Kubuntu</a>, d&eacute;veloppe Netrunner comme un bureau pr&eacute;vu pour une utilisation quotidienne bas&eacute;e sur Plasma Desktop, le bureau KDE. Ce syst&egrave;me d''exploitation cible aussi bien les nouveaux utilisateurs que les utilisateurs exp&eacute;riment&eacute;s avec GNU/Linux. Le bureau Plasma permet une personnalisation facile pour configurer l''interface &agrave; votre go&ucirc;t.</p>\r\n<p>Depuis la version 4.2, Netrunner est compos&eacute; de nouveaux logiciels et outils de configuration KDE pour une meilleure int&eacute;gration des services web tels que Google, Facebook et owncloud. Cela permet &agrave; l''utilisateur de visualiser, &eacute;diter et stocker ses donn&eacute;es comme les documents ou les calendriers dans l''environnement KDE et d''int&eacute;grer la messagerie instantan&eacute;e de Google ou Facebook avec <a title="KDE Telepathy" href="http://fr.wikipedia.org/wiki/KDE_Telepathy">KDE Telepathy</a>.<br /> Netrunner est disponible en versions <a class="mw-redirect" title="32 bits" href="http://fr.wikipedia.org/wiki/32_bits">32 bits</a> et <a class="mw-redirect" title="64 bits" href="http://fr.wikipedia.org/wiki/64_bits">64 bits</a>.<br /> Netrunner est bas&eacute; sur <a title="Kubuntu" href="http://fr.wikipedia.org/wiki/Kubuntu">Kubuntu</a> qui est une version d''<a title="Ubuntu" href="http://fr.wikipedia.org/wiki/Ubuntu">Ubuntu</a> avec l''environnement <a title="KDE" href="http://fr.wikipedia.org/wiki/KDE">KDE SC</a>. <a title="Ubuntu" href="http://fr.wikipedia.org/wiki/Ubuntu">Ubuntu</a> est lui bas&eacute; sur <a title="Debian" href="http://fr.wikipedia.org/wiki/Debian">Debian</a>.</p>\r\n<p>Infos : <a href="http://www.netrunner-os.com/netrunner-rolling-2014-09-1/">http://www.netrunner-os.com/netrunner-rolling-2014-09-1/</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/netrunner-small.png" alt="" width="480" height="384" /></p>', 2463842304, '2015-01-13 06:45:59', 'netrunner-rolling-2014.09.1-dvd-64bit.iso.torrent', 'netrunner.png', 324);
INSERT INTO `blog_posts_seo` (`postID`, `postTitle`, `postAuthor`, `postSlug`, `postDesc`, `postCont`, `postTaille`, `postDate`, `postTorrent`, `postImage`, `postViews`) VALUES
(22, 'Kali-Linux-1.0.9a-amd64', 'mumbly', 'kali-linux-1-0-9a-amd64', '<p><strong>Kali Linux</strong> est une distribution Linux sortie le 13 mars 2013, bas&eacute;e sur Debian. La distribution a pris la succession de Backtrack, qui &eacute;tait bas&eacute; sur Slackware jusqu''&agrave; la version 3 puis Ubuntu depuis la version 4. Backtrack &eacute;tait n&eacute;e de la fusion de Whax et Auditor.<br /> L''objectif de Kali Linux est de fournir une distribution regroupant l''ensemble des outils n&eacute;cessaires aux tests de s&eacute;curit&eacute; d''un syst&egrave;me d''information.</p>', '<p><strong>Kali Linux</strong> est disponible sous forme de live DVD. Il est &eacute;galement possible de l''installer sur un disque dur, sur une cl&eacute; USB, ou encore de mettre en place un d&eacute;marrage <a title="Preboot Execution Environment" href="http://fr.wikipedia.org/wiki/Preboot_Execution_Environment">PXE</a>. Il est &eacute;galement possible de construire son propre DVD en utilisant les scripts <a title="Debian" href="http://fr.wikipedia.org/wiki/Debian">Debian</a> live-build. Cette distribution est utilis&eacute;e par des auditeurs en s&eacute;curit&eacute; des syst&egrave;mes d''information comme Lexsi ou ACESI. Jean-Bernard YATA, expert en s&eacute;curit&eacute;, la recommande aupr&egrave;s de ses clients dans le cadre de l''audit automatis&eacute; de premier niveau, permettant d''&eacute;valuer la s&eacute;curit&eacute; intrins&egrave;que d''un environnement.</p>\r\n<p>Infos : <a href="https://www.kali.org/">https://www.kali.org/</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/kali-small.png" alt="" width="480" height="384" /></p>', 3053371392, '2015-01-13 07:11:08', 'kali-linux-1.0.9a-amd64.iso.torrent', 'kali.png', 558),
(23, 'Android-X86-4-4-r2', 'mumbly', 'android-x86-4-4-r2', '<p>La deuxi&egrave;me version stable d&rsquo;Android-x86 4.4-r2 (KitKat-MR2.2) incluant le support pour UEFI vient d&rsquo;&ecirc;tre publier par les d&eacute;veloppeurs d&rsquo;Android x86. de nombreuses fonctionnalit&eacute;s ont &eacute;t&eacute; introduites dans cette derni&egrave;re mise &agrave; jour rendant le syst&egrave;me d&rsquo;exploitation plus stable et fonctionnelle. on notera &eacute;galement la mise &agrave; niveau du noyau &agrave; la version 3.18 ce qui a pour effet le support des CPU Intel Baytrail. Sachez que les tables de partition GPT ne sont pas reconnu, sans doute que les versions future sauront palli&eacute; &agrave; ce probl&egrave;me. Pour plus de d&eacute;tails je vous invite &agrave; consulter cette page .</p>', '<p>Android-x86 est une initiative officieuse au syst&egrave;me d''exploitation mobile Android de Google pour le faire fonctionner sur des appareils aliment&eacute;s par des processeurs Intel et AMD x86, plut&ocirc;t que des puces ARM RISC. Le projet a commenc&eacute; comme une s&eacute;rie de correctifs pour le code source Android pour permettre &agrave;&nbsp; Android de fonctionner sur diff&eacute;rents netbooks et PC ultra-mobiles, en particulier l''ASUS Eee PC...</p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/androidx86-small.png" alt="" width="480" height="384" /></p>', 406847488, '2015-01-14 06:58:47', 'android-x86-4.4-r2.iso.torrent', 'Android-Logo-.jpg', 873),
(24, 'OpenBSD-5.6-amd64', 'mumbly', 'openbsd-5-6-amd64', '<p><strong>OpenBSD</strong> est un syst&egrave;me d''exploitation libre de type Unix, d&eacute;riv&eacute; de 4.4BSD. Cr&eacute;&eacute; en 1994 par Theo de Raadt, il est issu de la s&eacute;paration avec NetBSD, le plus ancien des trois autres principaux syst&egrave;mes d''exploitation de la famille des BSD aujourd''hui en activit&eacute;. Le projet OpenBSD est r&eacute;put&eacute; pour son intransigeance sur la libert&eacute; du logiciel et du code source, la qualit&eacute; de sa documentation, et l''importance accord&eacute;e &agrave; la s&eacute;curit&eacute; et la cryptographie int&eacute;gr&eacute;e.</p>', '<p>OpenBSD inclut un certain nombre de mesures de s&eacute;curit&eacute; absentes ou optionnelles dans d''autres syst&egrave;mes d''exploitation. Ses d&eacute;veloppeurs ont pour tradition de r&eacute;aliser des <a title="Audit" href="http://fr.wikipedia.org/wiki/Audit">audits</a> de code &agrave; la recherche de probl&egrave;mes de s&eacute;curit&eacute; et de <em><a title="Bug (informatique)" href="http://fr.wikipedia.org/wiki/Bug_%28informatique%29">bogues</a></em>. Le projet suit des politiques strictes sur les licences et pr&eacute;f&egrave;re sa propre licence <a title="Open source" href="http://fr.wikipedia.org/wiki/Open_source">open source</a> <a title="Licence ISC" href="http://fr.wikipedia.org/wiki/Licence_ISC">ISC</a> et autres variantes de la <a title="Licence BSD" href="http://fr.wikipedia.org/wiki/Licence_BSD">licence BSD</a>&nbsp;: dans le pass&eacute;, ceci a conduit &agrave; un audit exhaustif des licences et des remplacements, voire des suppressions de codes sous licences consid&eacute;r&eacute;es comme moins acceptables.</p>\r\n<p>&Agrave; l''instar de la plupart des syst&egrave;mes d''exploitation bas&eacute;s sur BSD, le <a class="mw-redirect" title="Noyau (informatique)" href="http://fr.wikipedia.org/wiki/Noyau_%28informatique%29">noyau</a> d''OpenBSD et ses programmes utilisateurs, tels que le <a class="mw-redirect" title="Shell (informatique)" href="http://fr.wikipedia.org/wiki/Shell_%28informatique%29">shell</a> et les outils habituels comme <a title="Cat (Unix)" href="http://fr.wikipedia.org/wiki/Cat_%28Unix%29">cat</a> et <a title="Ps (Unix)" href="http://fr.wikipedia.org/wiki/Ps_%28Unix%29">ps</a>, sont d&eacute;velopp&eacute;s dans un seul et m&ecirc;me d&eacute;p&ocirc;t <a title="Concurrent versions system" href="http://fr.wikipedia.org/wiki/Concurrent_versions_system">CVS</a>. Les logiciels tiers sont offerts en <a class="mw-redirect" title="Paquetage (logiciel)" href="http://fr.wikipedia.org/wiki/Paquetage_%28logiciel%29">paquets binaires</a> ou peuvent &ecirc;tre compil&eacute;s depuis leurs sources gr&acirc;ce &agrave; la collection des ports.</p>\r\n<p>Le projet est coordonn&eacute; par Theo de Raadt de sa maison &agrave; <a title="Calgary" href="http://fr.wikipedia.org/wiki/Calgary">Calgary</a>, <a title="Alberta" href="http://fr.wikipedia.org/wiki/Alberta">Alberta</a>, <a title="Canada" href="http://fr.wikipedia.org/wiki/Canada">Canada</a>, et la mascotte du projet est <a title="Puffy" href="http://fr.wikipedia.org/wiki/Puffy">Puffy</a>, un <a title="Diodon" href="http://fr.wikipedia.org/wiki/Diodon">diodon</a>.</p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/openbsd-small.png" alt="" width="480" height="384" /></p>', 238231552, '2015-01-14 17:13:46', 'install56.iso.torrent', 'openbsd_logo.jpg', 545),
(25, 'NetBSD-6.1.5-amd64', 'tornzen', 'netbsd-6-1-5-amd64', '<p><strong>NetBSD</strong>&nbsp;est un&nbsp;syst&egrave;me d''exploitation&nbsp;libre&nbsp;de&nbsp;type Unix&nbsp;BSD&nbsp;d&eacute;riv&eacute; de&nbsp;386BSD&nbsp;et de Net/2 (4.3BSD-Lite). NetBSD est enti&egrave;rement fond&eacute; sur des&nbsp;logiciels libres, la plupart des composants &eacute;tant soumis &agrave; la&nbsp;Licence BSD.<br /> Le syst&egrave;me d&eacute;tient le record sur le nombre d''architectures&nbsp;compatibles&nbsp;; il peut en effet &ecirc;tre utilis&eacute; sur plus de cinquante architectures diff&eacute;rentes.. Cette portabilit&eacute; est un point central du projet, si bien que sa devise est que face &agrave; tout ordinateur, on peut d&eacute;clarer&nbsp;: &laquo;&nbsp;Bien s&ucirc;r, cela fonctionne avec NetBSD&nbsp;&raquo; (de l''anglais &laquo;&nbsp;<em><span class="lang-en" lang="en" xml:lang="en">Of course it runs NetBSD</span></em>&nbsp;&raquo;). Pour l''anecdote, NetBSD a m&ecirc;me d&eacute;j&agrave; &eacute;t&eacute; port&eacute; sur un&nbsp;grille-pain.</p>', '<p>Un autre aspect sur lequel le projet met fortement l''accent est la qualit&eacute; du&nbsp;<a title="Code source" href="http://fr.wikipedia.org/wiki/Code_source">code</a>&nbsp;&eacute;crit. Le projet vise &agrave; d&eacute;velopper des solutions conceptuellement coh&eacute;rentes. Une fonctionnalit&eacute; relevant du bidouillage, m&ecirc;me efficace, n''est donc pas satisfaisante de ce point de vue. Ici une phrase souvent mise en avant est &laquo;&nbsp;des solutions, pas du bidouillage&nbsp;&raquo; (de l''anglais &laquo;&nbsp;<em><span class="lang-en" lang="en" xml:lang="en">Solutions, not&nbsp;<a title="Hack" href="http://fr.wikipedia.org/wiki/Hack">hacks</a></span></em>&nbsp;&raquo;).</p>\r\n<p>Le mod&egrave;le de d&eacute;veloppement retenu pour le projet est assez centralis&eacute;. Il est qualifi&eacute; de mod&egrave;le&nbsp;<a title="La Cath&eacute;drale et le Bazar" href="http://fr.wikipedia.org/wiki/La_Cath%C3%A9drale_et_le_Bazar">cath&eacute;drale</a>&nbsp;par opposition au mod&egrave;le&nbsp;<a title="La Cath&eacute;drale et le Bazar" href="http://fr.wikipedia.org/wiki/La_Cath%C3%A9drale_et_le_Bazar">bazar</a>.</p>\r\n<p>NetBSD est orient&eacute; vers une&nbsp;<a title="Ergonomie" href="http://fr.wikipedia.org/wiki/Ergonomie">ergonomie</a>&nbsp;privil&eacute;giant l''efficace &agrave; l''intuitif. Il est donc plus adapt&eacute; &agrave; un public d''<a title="Utilisateur (informatique)" href="http://fr.wikipedia.org/wiki/Utilisateur_(informatique)">utilisateurs</a>&nbsp;exp&eacute;riment&eacute;s, comme des&nbsp;<a class="mw-redirect" title="Administrateur syst&egrave;me" href="http://fr.wikipedia.org/wiki/Administrateur_syst%C3%A8me">administrateurs syst&egrave;me</a>&nbsp;ou des&nbsp;<a title="D&eacute;veloppeur" href="http://fr.wikipedia.org/wiki/D%C3%A9veloppeur">d&eacute;veloppeurs</a>.</p>\r\n<p>Pour une utilisation plus grand public, comme la&nbsp;<a title="Bureautique" href="http://fr.wikipedia.org/wiki/Bureautique">bureautique</a>, NetBSD sera moins convivial et disposera d''un moins bon support des&nbsp;<a title="P&eacute;riph&eacute;rique informatique" href="http://fr.wikipedia.org/wiki/P%C3%A9riph%C3%A9rique_informatique">p&eacute;riph&eacute;riques</a>&nbsp;que d''autres syst&egrave;mes, comme certaines&nbsp;<a title="Distribution Linux" href="http://fr.wikipedia.org/wiki/Distribution_Linux">distributions Linux</a>.</p>\r\n<p>En revanche, toutes les interfaces du&nbsp;<a title="Noyau de syst&egrave;me d''exploitation" href="http://fr.wikipedia.org/wiki/Noyau_de_syst%C3%A8me_d%27exploitation">noyau</a>&nbsp;et les&nbsp;<a title="Pilote informatique" href="http://fr.wikipedia.org/wiki/Pilote_informatique">pilotes</a>&nbsp;sont document&eacute;es dans des pages&nbsp;<a class="mw-redirect" title="Man (commande Unix)" href="http://fr.wikipedia.org/wiki/Man_(commande_Unix)">man</a>, et non dans des fichiers textes &eacute;parpill&eacute;s en divers endroits.</p>\r\n<p>Enfin NetBSD fait de la&nbsp;<a title="Compatibilit&eacute; ascendante et descendante" href="http://fr.wikipedia.org/wiki/Compatibilit%C3%A9_ascendante_et_descendante">r&eacute;tro compatibilit&eacute;</a>&nbsp;un de ses chevaux de bataille, et avec un noyau int&eacute;grant l''option COMPAT_09, le syst&egrave;me est capable d''ex&eacute;cuter des logiciels&nbsp;<a title="Compilateur" href="http://fr.wikipedia.org/wiki/Compilateur">compil&eacute;s</a>&nbsp;dans un&nbsp;<a title="Fichier ex&eacute;cutable" href="http://fr.wikipedia.org/wiki/Fichier_ex%C3%A9cutable">format binaire</a>&nbsp;de 1993.</p>\r\n<p>NetBSD est organis&eacute; autour de la&nbsp;<a title="NetBSD" href="http://fr.wikipedia.org/wiki/NetBSD#Fondation_NetBSD">fondation NetBSD</a>, une association &agrave; but non lucratif dont sont membres les d&eacute;veloppeurs. Le code source de NetBSD est disponible sur internet via&nbsp;<a class="mw-redirect" title="CVS" href="http://fr.wikipedia.org/wiki/CVS">CVS</a>&nbsp;et accessible en ligne via une interface cvsweb<span id="cite_ref-3" class="reference"><a href="http://fr.wikipedia.org/wiki/NetBSD#cite_note-3">3</a></span>&nbsp;Pour disposer d''un acc&egrave;s en commit sur le cvs de NetBSD, chaque d&eacute;veloppeur doit signer un&nbsp;<a class="external text" href="http://www.netbsd.org/developers/agreement.txt" rel="nofollow">accord d''agr&eacute;ment</a>&nbsp;qui le rend membre de la fondation NetBSD. Le conseil d''administration de la fondation NetBSD, &eacute;lu par les d&eacute;veloppeurs, publie des rapports r&eacute;guliers sur ses activit&eacute;s et sur les finances<span id="cite_ref-4" class="reference"><a href="http://fr.wikipedia.org/wiki/NetBSD#cite_note-4">4</a></span>&nbsp;du projet. NetBSD comporte 300 d&eacute;veloppeurs en 2006.</p>\r\n<p>Le projet NetBSD a &eacute;t&eacute; fond&eacute; par&nbsp;<a class="new" title="Chris Demetriou (page inexistante)" href="http://fr.wikipedia.org/w/index.php?title=Chris_Demetriou&amp;action=edit&amp;redlink=1">Chris Demetriou</a>&nbsp;<a class="extiw" title="es:Christopher G. Demetriou" href="http://es.wikipedia.org/wiki/Christopher_G._Demetriou"><span class="indicateur-langue" title="&Eacute;quivalent de l&rsquo;article &laquo; Chris Demetriou &raquo; dans une autre langue">(es)</span></a>,&nbsp;<a title="Theo de Raadt" href="http://fr.wikipedia.org/wiki/Theo_de_Raadt">Theo de Raadt</a>, Adam Glass et Charles Hannum en&nbsp;<span class="date-lien nowrap datasortkey" data-sort-value="1993-03"><a title="Mars 1993" href="http://fr.wikipedia.org/wiki/Mars_1993">mars</a>&nbsp;<a title="1993 en informatique" href="http://fr.wikipedia.org/wiki/1993_en_informatique">1993</a></span>. La formation du projet fait suite &agrave; la stagnation relative du d&eacute;veloppement et l''impossibilit&eacute; de faire accepter des&nbsp;<a title="Patch (informatique)" href="http://fr.wikipedia.org/wiki/Patch_(informatique)">patchs</a>&nbsp;externes dans&nbsp;<a title="386BSD" href="http://fr.wikipedia.org/wiki/386BSD">386BSD</a>.</p>\r\n<p>En 1994 et 1995, des d&eacute;saccords surviennent dans l''&eacute;quipe de d&eacute;veloppement, qui s''&eacute;talent pendant pr&egrave;s de 8 mois sur les listes de diffusion. Certains d&eacute;veloppeurs autour de&nbsp;<a title="Theo de Raadt" href="http://fr.wikipedia.org/wiki/Theo_de_Raadt">Theo de Raadt</a>&nbsp;quittent l''&eacute;quipe puis cr&eacute;ent<a title="OpenBSD" href="http://fr.wikipedia.org/wiki/OpenBSD">OpenBSD</a>. Les deux syst&egrave;mes d''exploitation divergent dans un certain nombre de domaines, comme par exemple l''initialisation du syst&egrave;me, mais restent cependant assez proches pour que le portage de pilotes de l''un &agrave; l''autre soit relativement facile. Ainsi les deux BSD utilisent tous deux le framework wscons<span id="cite_ref-5" class="reference"><a href="http://fr.wikipedia.org/wiki/NetBSD#cite_note-5">5</a></span>, le m&ecirc;me syst&egrave;me de nomenclature de p&eacute;riph&eacute;riques, et distribuent les m&ecirc;mes&nbsp;<a class="mw-redirect" title="Shell (informatique)" href="http://fr.wikipedia.org/wiki/Shell_(informatique)">shells</a>&nbsp;dans le syst&egrave;me de base...</p>\r\n<p>Infos :&nbsp;<a href="http://www.netbsd.org/">http://www.netbsd.org/</a></p>', 347082752, '2015-01-15 09:15:15', 'NetBSD-6.1.5-amd64.iso.torrent', 'netbsd-logo.png', 402),
(26, 'Q4OS-0.5.23-64bit', 'mumbly', 'q4os-0-5-23-64bit', '<p>Q4OS est une distribution Linux bas&eacute;e sur Debian Wheezy et d&eacute;velopp&eacute;e pour fournir une exp&eacute;rience similaire &agrave; Windows XP.<br />Q4OS est en fait l&rsquo;un des rares syst&egrave;mes d&rsquo;exploitation Linux qui ne ressemblent pas seulement &agrave; Windows, car il va bien au-del&agrave;. Certaines distributions Linux partagent la m&ecirc;me conception de l&rsquo;environnement de bureau g&eacute;n&eacute;ral, mais ils sont diff&eacute;rents dans tous les autres. Q4OS est aussi proche d&rsquo;un clone que possible, tout en utilisant le noyau Linux et un environnement de bureau d&eacute;di&eacute;.</p>', '<p><strong>VERSION 64 bits</strong></p>\r\n<p>Q4OS utilise un environnement de bureau appel&eacute; Trinity DE, qui est d&eacute;riv&eacute; d&rsquo;une ancienne version 3.x de KDE. Certains utilisateurs Linux plus anciens se souviendront que KDE ressemble quelque peu &agrave; Windows XP et il existe toujours, mais n&rsquo;est pas aussi comme par le pass&eacute;. &laquo; La nouvelle caract&eacute;ristique essentielle est l&rsquo;int&eacute;gration du bureau KDE4 dans le syst&egrave;me Q4OS. Il est compos&eacute; de deux th&egrave;mes de plasma, ic&ocirc;nes crystalsvg converties, th&egrave;me de d&eacute;marrage et ressemblance au look original. Le script de commande simple&nbsp; &raquo; kde4-install&nbsp; &raquo; pour une installation facile et automatique est incluse. Si l&rsquo;utilisateur veut ne configuration compl&egrave;te de bureau KDE4 aux c&ocirc;t&eacute;s de bureau Q4OS standard, il lancera e script &laquo; kde4-install &raquo; &agrave; partir du terminal.&nbsp; &raquo; &laquo; Il sera en mesure de choisir l&rsquo;option &raquo; KDE espace de travail Plasma&nbsp; &raquo; sur l&rsquo;&eacute;cran de connexion KDM type de session et de faire l&rsquo;exp&eacute;rience avec un tout nouvel environnement. Il sera libre de choisir le bureau basique de Q4OS classique aussi, bien s&ucirc;r &raquo;, lit-on dans l&rsquo;annonce des d&eacute;veloppeurs. Malheureusement, il n&rsquo;y a pas de version Live CD, vous aurez donc besoin d&rsquo;installer ce syst&egrave;me d&rsquo;exploitation afin de le tester. Les bonnes nouvelles sont qu&rsquo;il fonctionne tr&egrave;s bien dans VirtualBox, qui rend les tests assez facile. En fait, de nombreux d&eacute;veloppeurs devraient apprendre de Q4OS comment rendre leur syst&egrave;me plus compatible avec les environnements virtuels.<br /><br />Plus d''infos : <a href="http://q4os.org">http://q4os.org</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/q4os.png" alt="" width="480" height="384" /></p>', 324009984, '2015-01-16 07:12:22', 'q4os-0.5.23-x64.iso.torrent', 'Q4OS1.jpg', 379),
(27, 'Q4OS-0.5.23-32bit', 'mumbly', 'q4os-0-5-23-32bit', '<p>Q4OS est une distribution Linux bas&eacute;e sur Debian Wheezy et d&eacute;velopp&eacute;e pour fournir une exp&eacute;rience similaire &agrave; Windows XP.<br />Q4OS est en fait l&rsquo;un des rares syst&egrave;mes d&rsquo;exploitation Linux qui ne ressemblent pas seulement &agrave; Windows, car il va bien au-del&agrave;. Certaines distributions Linux partagent la m&ecirc;me conception de l&rsquo;environnement de bureau g&eacute;n&eacute;ral, mais ils sont diff&eacute;rents dans tous les autres. Q4OS est aussi proche d&rsquo;un clone que possible, tout en utilisant le noyau Linux et un environnement de bureau d&eacute;di&eacute;.</p>', '<p><strong>VERSION 32 bit - i386<br /></strong></p>\r\n<p>Q4OS utilise un environnement de bureau appel&eacute; Trinity DE, qui est d&eacute;riv&eacute; d&rsquo;une ancienne version 3.x de KDE. Certains utilisateurs Linux plus anciens se souviendront que KDE ressemble quelque peu &agrave; Windows XP et il existe toujours, mais n&rsquo;est pas aussi comme par le pass&eacute;. &laquo; La nouvelle caract&eacute;ristique essentielle est l&rsquo;int&eacute;gration du bureau KDE4 dans le syst&egrave;me Q4OS. Il est compos&eacute; de deux th&egrave;mes de plasma, ic&ocirc;nes crystalsvg converties, th&egrave;me de d&eacute;marrage et ressemblance au look original. Le script de commande simple&nbsp; &raquo; kde4-install&nbsp; &raquo; pour une installation facile et automatique est incluse. Si l&rsquo;utilisateur veut ne configuration compl&egrave;te de bureau KDE4 aux c&ocirc;t&eacute;s de bureau Q4OS standard, il lancera e script &laquo; kde4-install &raquo; &agrave; partir du terminal.&nbsp; &raquo; &laquo; Il sera en mesure de choisir l&rsquo;option &raquo; KDE espace de travail Plasma&nbsp; &raquo; sur l&rsquo;&eacute;cran de connexion KDM type de session et de faire l&rsquo;exp&eacute;rience avec un tout nouvel environnement. Il sera libre de choisir le bureau basique de Q4OS classique aussi, bien s&ucirc;r &raquo;, lit-on dans l&rsquo;annonce des d&eacute;veloppeurs. Malheureusement, il n&rsquo;y a pas de version Live CD, vous aurez donc besoin d&rsquo;installer ce syst&egrave;me d&rsquo;exploitation afin de le tester. Les bonnes nouvelles sont qu&rsquo;il fonctionne tr&egrave;s bien dans VirtualBox, qui rend les tests assez facile. En fait, de nombreux d&eacute;veloppeurs devraient apprendre de Q4OS comment rendre leur syst&egrave;me plus compatible avec les environnements virtuels.<br /><br />Plus d''infos : <a href="http://q4os.org">http://q4os.org</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/q4os.png" alt="" width="480" height="384" /></p>', 348127232, '2015-01-16 07:15:34', 'q4os-0.5.23-i386.iso.torrent', 'Q4OS1.jpg', 553),
(28, 'Tails-i386-1.2.3', 'mumbly', 'tails-i386-1-2-3', '<p>Tails est un syst&egrave;me d''exploitation complet destin&eacute; &agrave; &ecirc;tre utilis&eacute; depuis un DVD, une clef USB ou une carte SD ind&eacute;pendamment du syst&egrave;me install&eacute; sur l''ordinateur. C''est un logiciel libre bas&eacute; sur Debian GNU/Linux.<br /> Tails est un syst&egrave;me live dont le but est de pr&eacute;server votre vie priv&eacute;e et votre anonymat. Il vous permet d''utiliser Internet de mani&egrave;re anonyme et de contourner la censure quasiment partout o&ugrave; vous allez et sur n''importe quel ordinateur. Tails ne laisse aucune trace de ce que vous avez fait, sauf si vous le demandez explicitement.</p>', '<p>Tails est livr&eacute; avec de nombreuses applications, configur&eacute;es avec une attention particuli&egrave;re accord&eacute;e &agrave; la s&eacute;curit&eacute; : navigateur web, client de messagerie instantan&eacute;e, client email, suite bureautique, &eacute;diteur d''image et de son, etc.</p>\r\n<p>Tails d&eacute;pend du r&eacute;seau d''anonymisation de Tor pour prot&eacute;ger votre vie priv&eacute;e en ligne :</p>\r\n<ul>\r\n<li>tous les logiciels sont configur&eacute;s de mani&egrave;re &agrave; se connecter &agrave; Internet via Tor</li>\r\n<li>si une application tente de se connecter &agrave; Internet directement, la connexion est automatiquement bloqu&eacute;e pour des raisons de s&eacute;curit&eacute;.</li>\r\n</ul>\r\n<p>Tor est un logiciel libre et un r&eacute;seau ouvert qui vous aide &agrave; vous d&eacute;fendre contre une forme de surveillance qui menace les libert&eacute;s individuelles et la vie priv&eacute;e, les activit&eacute;s et relations professionnelles confidentielles, et la s&eacute;curit&eacute; d''&Eacute;tat connue sous le nom d''analyse de trafic</p>\r\n<p>Tor vous prot&egrave;ge en faisant transiter vos communications au sein d''un r&eacute;seau distribu&eacute; de relais h&eacute;berg&eacute;s par des volontaires partout dans le monde : il emp&ecirc;che quiconque observant votre connexion Internet de savoir quels sites vous visitez, et il emp&ecirc;che le site que vous visitez de savoir o&ugrave; vous vous trouvez.</p>\r\n<p>En utilisant Tor vous pouvez :</p>\r\n<ul>\r\n<li>&ecirc;tre anonyme en ligne, en cachant votre emplacement,</li>\r\n<li>vous connecter &agrave; des services qui seraient censur&eacute;s sinon&nbsp;;</li>\r\n<li>r&eacute;sister &agrave; des attaques qui bloquent l''utilisation de Tor, gr&acirc;ce &agrave; des outils de contournement tels que les <a href="https://tails.boum.org/doc/first_steps/startup_options/bridge_mode/index.fr.html">bridges</a>.</li>\r\n</ul>\r\n<p>L''utilisation de Tails ne modifie pas le syst&egrave;me d''exploitation install&eacute; sur l''ordinateur. Vous pouvez donc l''utiliser que vous soyez chez vous, chez un ami ou &agrave; la biblioth&egrave;que du coin. Une fois votre DVD, clef USB ou carte SD Tails retir&eacute;e de l''ordinateur, celui-ci peut red&eacute;marrer sur le syst&egrave;me d''exploitation habituel.</p>\r\n<p>Tails est sp&eacute;cialement configur&eacute; pour ne pas utiliser le disque dur de l''ordinateur, pas m&ecirc;me l''espace swap. Le seul espace de stockage utilis&eacute; par Tails est la m&eacute;moire RAM, qui est effac&eacute;e automatiquement &agrave; l''extinction de l''ordinateur. Vous ne laisserez donc aucune trace, que ce soit du syst&egrave;me Tails ou de ce que vous avez fait, sur l''ordinateur. C''est pourquoi nous le qualifions d''"amn&eacute;sique".</p>\r\n<p>Cela vous permet de travailler sur un document sensible sur n''importe quel ordinateur tout en emp&ecirc;chant la r&eacute;cup&eacute;ration de ces donn&eacute;es une fois l''ordinateur &eacute;teint. Bien s&ucirc;r, vous pouvez toujours sauvegarder vos documents sur une clef USB ou un disque dur externe afin de les garder pour une prochaine utilisation.</p>\r\n<p>Tails comprend &eacute;galement une s&eacute;lection d''outils de protection de donn&eacute;es utilisant un chiffrement robuste:</p>\r\n<ul>\r\n<li>\r\n<p><a href="https://tails.boum.org/doc/encryption_and_privacy/encrypted_volumes/index.fr.html">Chiffrez votre cl&eacute; USB ou votre disque dur externe</a> avec <span class="definition"><a href="https://en.wikipedia.org/wiki/Linux%5FUnified%5FKey%5FSetup">LUKS</a></span>, le standard de Linux en mati&egrave;re de chiffrement de volume.</p>\r\n</li>\r\n<li>\r\n<p>Chiffrez automatiquement en HTTPS toutes vos communications vers de nombreux sites web en utilisant <a href="https://www.eff.org/https-everywhere">HTTPS Everywhere</a>, une extension Firefox d&eacute;velopp&eacute;e par la <a href="https://www.eff.org">Electronic Frontier Foundation</a>.</p>\r\n</li>\r\n<li>\r\n<p>Chiffrez et signez vos emails et documents depuis le client mail de Tails, l''&eacute;diteur de texte ou le navigateur de fichiers gr&acirc;ce au standard <em>de facto</em> <span class="definition"><a href="https://secure.wikimedia.org/wikipedia/fr/wiki/OpenPGP">OpenPGP</a></span>.</p>\r\n</li>\r\n<li>\r\n<p>Prot&eacute;gez vos conversations par messagerie instantan&eacute;e en utilisant <span class="definition"><a href="https://en.wikipedia.org/wiki/Off%2Dthe%2DRecord%5FMessaging">OTR</a></span>, un outil cryptographique qui fournit chiffrement, authentification ainsi que la possibilit&eacute; du d&eacute;ni plausible.</p>\r\n</li>\r\n<li>\r\n<p><a href="https://tails.boum.org/doc/encryption_and_privacy/secure_deletion/index.fr.html">Supprimez vos fichiers de fa&ccedil;on s&ucirc;re</a> et nettoyez votre espace disque gr&acirc;ce &agrave; <a href="http://wipetools.tuxfamily.org/nautilus-wipe.html">Nautilus Wipe</a>.</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;Infos : <a href="https://tails.boum.org/">https://tails.boum.org/</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/tails-small.png" alt="" width="480" height="384" /></p>', 951764992, '2015-01-16 12:51:39', 'tails-i386-1.2.3.iso.torrent', 'Tails-Logo.jpg', 1018),
(33, 'manjaro-enlightenment-0.8.11-net-noefi-x86_64.iso', 'mumbly', 'manjaro-enlightenment-0-8-11-net-noefi-x86-64-iso', '<p><strong>VERSION Net Edition noefi, avec Enlightenment, live CD</strong><br />Manjaro Linux, ou tout simplement Manjaro (prononc&eacute; comme dans Kilimanjaro), est une distribution Linux utilisant XFCE comme interface utilisateur par d&eacute;faut.<br /> C''est d''abord un syst&egrave;me d''exploitation libre pour ordinateurs personnels qui sait rester simple d''utilisation tout en mettant &agrave; disposition la richesse de la communaut&eacute; Arch Linux. Il utilise par ailleurs un mod&egrave;le de d&eacute;veloppement similaire &agrave; sa grande s&oelig;ur, de type rolling release.</p>', '<p>Manjaro Linux, ou tout simplement Manjaro (prononc&eacute; comme dansKilimanjaro), est une distribution Linux utilisant XFCE comme interface utilisateur par d&eacute;faut. C''est d''abord un syst&egrave;me d''exploitation libre pour ordinateurs personnels qui sait rester simple d''utilisation tout en mettant &agrave; disposition la richesse de la communaut&eacute; Arch Linux. Il utilise par ailleurs un mod&egrave;le de d&eacute;veloppement similaire &agrave; sa grande s&oelig;ur, de type rolling release.</p>\r\n<p>Infos : <a href="http://www.manjaro.fr/forum/viewtopic.php?f=2006&amp;t=5197&amp;sid=74746de37c0119f4dc590091144b2463">http://www.manjaro.fr/forum/viewtopic.php?f=2006&amp;t=5197&amp;sid=74746de37c0119f4dc590091144b2463</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="https://www.enlightenment.org/ss/e-53359d23765354.32207612.jpg" alt="" width="480" height="270" /></p>', 537919488, '2015-01-17 16:36:29', 'manjaro-enlightenment-0.8.11-net-noefi-x86_64.iso.torrent', 'Manjaro-logo.png', 622),
(34, 'KaOs-2014-12-x86_64', 'mumbly', 'kaos-2014-12-x86-64', '<p>Kaos est une distribution Linux pour&nbsp;bureau qui int&egrave;gre la derni&egrave;re version de l''environnement de bureau KDE, la suite bureautique Calligra, et d''autres applications logicielles populaires qui utilisent le toolkit Qt.<br /> Cette distribution a &eacute;t&eacute; inspir&eacute;e par Arch Linux, mais les d&eacute;veloppeurs ont construit&nbsp;leurs propres paquets qui sont disponibles &agrave; partir des d&eacute;pots&nbsp; internes. Kaos emploie un mod&egrave;le de d&eacute;veloppement "Rolling-Release" et est construit exclusivement pour les syst&egrave;mes informatiques 64 bits.</p>', '<p>L''objectif de KaOS est de cr&eacute;er une distribution mise &agrave; jour en continu et transparente, avec un bureau moderne, construite &agrave; partir de z&eacute;ro et se concentrant sur des besoins tr&egrave;s sp&eacute;cifiques. Ces sp&eacute;cificit&eacute;s consistent en un seul environnement de bureau (KDE), une seule interface graphique (Qt), une seule architecture (x86_64) et les outils et applications sont soigneusement s&eacute;lectionn&eacute;s pour &ecirc;tre les plus appropri&eacute;s.</p>\r\n<p>Tout le travail r&eacute;alis&eacute; est orient&eacute; vers l''int&eacute;gration et non sur le d&eacute;veloppement d''applications ou de nouveaux outils.<br />L''objectif n''&eacute;tant en aucun cas de mettre &agrave; disposition un maximum de paquets, KaOS reste limit&eacute; en taille dans ses d&eacute;p&ocirc;ts, et se concentre sur la qualit&eacute; plut&ocirc;t que sur la quantit&eacute;. Cet objectif rend de ce fait la recherche d''une solide base utilisateurs superflue.</p>\r\n<p>Elle s''adresse aux utilisateurs qui ont test&eacute; de nombreux syst&egrave;mes d''exploitation / distributions / environnements de bureau et qui savent qu''ils pr&eacute;f&egrave;rent une distribution qui concentre toutes ses ressources disponibles sur un seul environnement de bureau afin d''en tirer le meilleur, et pensent que KDE est le meilleur d''entre eux.</p>\r\n<p>Infos : <a href="http://kaosx.us/">http://kaosx.us/</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/kaos.png" alt="" width="480" height="384" /></p>', 1753006080, '2015-01-18 14:18:59', 'KaOS-2014.12-x86_64.iso.torrent', 'kaos-1.png', 673),
(35, 'semplice-7-preview-64bit', 'mumbly', 'semplice-7-preview-64bit', '<p>Semplice Linux est une distribution simple, rapide et l&eacute;g&egrave;re bas&eacute;e sur la branche unstable de Debian. Elle&nbsp;comprend une petite collection d''applications mises &agrave; jour r&eacute;guli&egrave;rement et tournant gr&acirc;ce au&nbsp;gestionnaire de fen&ecirc;tres <strong>Openbox</strong>.</p>', '<p>&nbsp;</p>\r\n<p>Distribution qui se veut simple, dynamique, rapide, &eacute;l&eacute;gante et de type "rolling-release".</p>\r\n<p>Infos : <a href="http://semplice-linux.org/">http://semplice-linux.org/</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/semplice-small.png" alt="" width="480" height="384" /></p>', 697057280, '2015-01-19 11:47:31', 'semplice64_current-devel-7_636.0.iso.torrent', 'semplice.png', 452),
(36, 'MakuluLinux-Cinnamon-2.0', 'mumbly', 'makululinux-cinnamon-2-0', '<p>MakuluLinux est une distribution bas&eacute;e sur Debian offrant une exp&eacute;rience &eacute;l&eacute;gante, simple et stable pour l''utilisateur, ceci sur n''importe quel ordinateur.<br /> Cette distribution comprend des codecs multim&eacute;dia pr&eacute;install&eacute;s, des pilotes de p&eacute;riph&eacute;riques et de logiciels pour un usage quotidien...</p>', '<p><span id="result_box" class="" lang="fr"><span class="hps">MakuluLinux</span> <span class="hps">Cinnamon</span> <span class="hps">2.0</span> <span class="hps atn">(</span><span class="">MCDE</span>) <span class="hps">est une suite de</span> <span class="hps">la premi&egrave;re version</span>. Cette <span class="hps">2.0 met</span> <span class="hps">l''accent sur</span> <span class="hps">la mise &agrave; jour</span><span class="">, le polissage</span>, le raffinage et <span class="hps">la r&eacute;solution des probl&egrave;mes</span> <span class="hps">signal&eacute;s</span> <span class="hps">dans la version pr&eacute;c&eacute;dente</span>. <span class="hps">Il y a beaucoup de</span> <span class="hps">petits changements</span> <span class="hps">dans tout le syst&egrave;me</span> <span class="hps">pour donner</span> <span class="hps">juste</span> <span class="hps">une sensation</span> <span class="hps">de simplicit&eacute; et plus</span> <span class="hps">raffin&eacute;e</span>. <span class="hps">Il y a aussi</span> <span class="hps">des changements majeurs dans</span> <span class="hps">cette version</span>, ... certains changements <span class="hps">seront</span> <span class="hps">backport&eacute;es</span> <span class="hps">&agrave; la version 1,1</span><span class="">, d''autres non</span><span class="">.</span></span></p>\r\n<p><span class="" lang="fr"><span class="">Infos : <a>http://makululinux.com/cinnamon/</a></span></span></p>\r\n<p><span class="" lang="fr"><span class=""><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/makulu-small.png" alt="" width="480" height="384" /></span></span></p>', 1311162368, '2015-01-22 06:59:29', 'MakuluLinux_Cinnamon_2.0.iso.torrent', 'makulu.png', 595),
(37, 'Handylinux-1.8-i686', 'mumbly', 'handylinux-1-8-i686', '<p><strong>HandyLinux</strong> est une distribution Linux francophone et anglophone de la famille des d&eacute;riv&eacute;es officielles de Debian. Elle est con&ccedil;ue pour les d&eacute;butants en informatique, les seniors &eacute;quip&eacute;s de vieux ordinateurs devenus trop lents sous Windows et ceux qui veulent se lib&eacute;rer de Microsoft.<br /> Les utilisateurs participent &agrave; son am&eacute;lioration en proposant sur le forum des modifications et de nouvelles fonctionnalit&eacute;s qui sont ensuite int&eacute;gr&eacute;es par le d&eacute;veloppeur.</p>', '<h4>Ce syst&egrave;me d''exploitation a &eacute;t&eacute; con&ccedil;u pour faciliter l''acc&egrave;s &agrave; l''informatique &agrave; tous ceux qui d&eacute;butent, des enfants aux seniors. Pour cela, elle comprend :</h4>\r\n<div class="main-feature left-feature distribution">\r\n<h4>Un pack simplifi&eacute; d''applications</h4>\r\n<p>Sp&eacute;cialement choisis pour une navigation sur le net, la gestion de vos mails, l''usage bureautique autour d''une suite office compl&egrave;te, des logiciels pour g&eacute;rer vos biblioth&egrave;ques multim&eacute;dia (photo/audio/vid&eacute;o), de quoi discuter avec votre famille et vos amis et tout cela facilement accessible depuis le HandyMenu.</p>\r\n</div>\r\n<div class="main-feature right-feature logitheque">\r\n<h4>Une gigantesque logith&egrave;que</h4>\r\n<p>Riche de milliers d''applications, la logith&egrave;que de la distribution m&egrave;re GNU/Linux Debian est accessible en quelques clics, aussi tous vos besoins sp&eacute;cifiques seront couverts.</p>\r\n</div>\r\n<div class="main-feature left-feature documentation">\r\n<h4>Une documentation hors-norme</h4>\r\n<p>Tr&egrave;s attach&eacute;e au partage des connaissances, la communaut&eacute; HandyLinux vous donne acc&egrave;s &agrave; une documentation d&eacute;taill&eacute;e du syst&egrave;me, pour le prendre en main autour d''une initiation int&eacute;gr&eacute;e, mais aussi pour aller plus loin et construire votre environnement de travail propre.</p>\r\n</div>\r\n<div class="main-feature right-feature accessibilite">\r\n<h4>Des outils d''accessibilit&eacute;</h4>\r\n<p>Car il ne serait pas juste de ne pas en tenir compte, HandyLinux int&egrave;gre nativement des outils pour combattre des situations de handicap, comme la loupe d''&eacute;cran, un clavier virtuel ou encore la synth&egrave;se vocale disponible dans Iceweasel.</p>\r\n</div>\r\n<div class="main-feature left-feature communaute">\r\n<h4>Une gouvernance coll&eacute;giale</h4>\r\n<p>Un usage peu courant dans le monde informatique o&ugrave; g&eacute;n&eacute;ralement les d&eacute;veloppeurs imposent les choix, ici, tout est sujet &agrave; d&eacute;bat, et si l''int&eacute;r&ecirc;t est grandissant pour un outil, ce dernier sera sans nul doute adopt&eacute; par toute la communaut&eacute;. Les vrais d&eacute;cisionnaires, c''est nous tous ensemble !</p>\r\n<p>Infos : <a href="http://handylinux.org/">http://handylinux.org/</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/handy-small.png" alt="" width="480" height="384" /></p>\r\n</div>', 1252147200, '2015-01-22 07:11:03', 'handylinux-1.8-686.iso.torrent', 'handy.png', 603),
(38, 'Robolinux64-gnome-7.8.1', 'mumbly', 'robolinux64-gnome-7-8-1', '<p>Robolinux est un syst&egrave;me d''exploitation conviviale et intuitif bas&eacute; sur la derni&egrave;re version stable de Debian GNU / Linux.<br /> Une des caract&eacute;ristiques les plus int&eacute;ressantes de ce projet est la disponibilit&eacute; d''une machine virtuelle pr&eacute;-configur&eacute; avec Windows XP ou Windows 7 - une configuration VirtualBox qui permet &agrave; l''utilisateur d''installer et ex&eacute;cuter le syst&egrave;me d''exploitation Windows de fa&ccedil;on transparente aux c&ocirc;t&eacute;s de Robolinux.</p>', '<p>Infos : <a href="http://www.robolinux.org/">http://www.robolinux.org/</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/robolinux-small.png" alt="" width="480" height="384" /></p>', 2096154624, '2015-01-22 19:50:18', 'robolinux64-gnome-v7.8.1.iso.torrent', 'robolinux.png', 581),
(39, 'MidnightBSD-0.5.2', 'tornzen', 'midnightbsd-0-5-2', '<p>MidnightBSD est un syst&egrave;me d''exploitation d&eacute;riv&eacute; de FreeBSD. Un des objectifs essentiels du projet est de cr&eacute;er un environnement de bureau facile &agrave; utiliser avec la gestion des ports graphiques, et la configuration du syst&egrave;me en utilisant GNUstep.<br /> La grande majorit&eacute; du syst&egrave;me d''exploitation maintiendra une licence BSD. MidnightBSD &eacute;t&eacute; "fork&eacute;" depuis FreeBSD 6.1 beta.</p>', '<p>MidnightBSD est un nouveau syst&egrave;me d''exploitation BSD d&eacute;velopp&eacute; pour les utilisateurs de bureau. Il comprend tous les logiciels que vous attendez pour vos t&acirc;ches quotidiennes - email, navigation Web, traitement de texte, jeux, et bien plus encore.<br /> Avec une petite communaut&eacute; de d&eacute;veloppeurs d&eacute;di&eacute;s, MidnightBSD s''efforce de cr&eacute;er un syst&egrave;me d''exploitation pour "tout le monde", facile &agrave; utiliser, librement . Disponible pour les architectures x86, AMD64 et machines virtuelles.</p>\r\n<p>Infos : <a href="http://www.midnightbsd.org">http://www.midnightbsd.org</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://www.midnightbsd.org/art/logo/MidnightBSDLogo.svg" alt="" width="480" height="480" /></p>', 772673536, '2015-01-24 14:14:50', 'MidnightBSD-release.iso.torrent', 'midnightbsd.png', 573),
(40, '4MLinux-11.0-allinone-edition', 'mumbly', '4mlinux-11-0-allinone-edition', '<p>4MLinux est une distribution miniature GNU/Linux ind&eacute;pendante se concentrant sur quatre objectifs&nbsp;: l''entretien (en tant que live CD "rescue"), multim&eacute;dia (pour la lecture de DVD vid&eacute;o et autres fichiers multim&eacute;dias), miniserver (en utilisant le d&eacute;mon inetd), et "amusement" (fournissant plusieurs petits jeux Linux). Elle utilise le bureau JWM.</p>', '<p>En fait, cette distribution s''appelle 4MLinux car elle essaie de se concentrer sur les 4 M suivants :</p>\r\n<p>- <strong>M</strong>aintenance (system rescue Live CD),<br />- <strong>M</strong>ultimedia (lecture de&nbsp;video DVDs),<br />- <strong>M</strong>iniserver (en utilisant le daemon&nbsp;inetd),<br />- <strong>M</strong>ystery (amusement sous forme d''une collection de jeux Linux...).</p>\r\n<p>A noter que cette distribution est "from scratch" c''est &agrave; dire non bas&eacute;e ou issue d''une branche officielle "mainstream" telles que Debian, Ubuntu, etc. et le bureau par d&eacute;faut de est <a href="http://www.linuxpedia.fr/doku.php/jwm">JWM</a>...</p>\r\n<p>Infos :&nbsp;<a href="http://4mlinux.com/">http://4mlinux.com/</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/4mlinux-small.png" alt="" width="480" height="384" /></p>', 407824384, '2015-01-26 09:47:46', '4MLinux-11.0-allinone-edition.iso.torrent', '4mlinux.png', 499),
(41, 'manjaro-openbox-0.8.11-x86_64', 'mumbly', 'manjaro-openbox-0-8-11-x86-64', '<p><strong>VERSION OpenBox Community Edition</strong><br /> Manjaro Linux, ou tout simplement Manjaro (prononc&eacute; comme dans kilimanjaro), est une distribution Linux tilisant XFCE comme interface utilisateur par d&eacute;faut. C''est d''abord un syst&egrave;me d''exploitation libre pour ordinateurs personnels qui sait rester simple d''utilisation tout en mettant &agrave; disposition la richesse de la communaut&eacute; Arch Linux. Il utilise par ailleurs un mod&egrave;le de d&eacute;veloppement similaire &agrave; sa grande s&oelig;ur, de type rolling release.</p>', '<p>Manjaro Linux, ou tout simplement Manjaro (prononc&eacute; comme dansKilimanjaro), est une distribution Linux utilisant XFCE comme interface utilisateur par d&eacute;faut. C''est d''abord un syst&egrave;me d''exploitation libre pour ordinateurs personnels qui sait rester simple d''utilisation tout en mettant &agrave; disposition la richesse de la communaut&eacute; Arch Linux. Il utilise par ailleurs un mod&egrave;le de d&eacute;veloppement similaire &agrave; sa grande s&oelig;ur, de type rolling release.<br /><br />Infos : <a href="http://sourceforge.net/projects/manjarolinux/files/community/Openbox/2014.12/">http://sourceforge.net/projects/manjarolinux/files/community/Openbox/2014.12/</a></p>', 759169024, '2015-01-29 13:26:09', 'manjaro-openbox-0.8.11-x86_64.iso.torrent', 'Manjaro-logo.png', 397),
(42, 'SolydX-64bit-201501', 'mumbly', 'solydx-64bit-201501', '<p>SolydX et SolydK sont des distributions bas&eacute;es sur Debian avec les environnements de bureau Xfce et KDE. SolydXK vise &agrave; &ecirc;tre simple &agrave; utiliser, offrant un environnement qui est &agrave; la fois stable et s&ucirc;r. SolydXK est une alternative open-source pour les petites entreprises, les organisations &agrave; but non lucratif et les utilisateurs &agrave; domicile. Le projet a d&eacute;marr&eacute; comme une variante officieuse de Linux Mint Debian Edition avec KDE comme bureau par d&eacute;faut, mais il a ensuite &eacute;t&eacute; donn&eacute; sa propre identit&eacute; en tant que SolydK. SolydX a &eacute;t&eacute; d&eacute;marr&eacute; apr&egrave;s que Linux Mint abandonne sa version bas&eacute;e sur Debian qui utilisait le bureau Xfce.</p>', '<p>Version 64 bit avec XFCE</p>\r\n<p>Infos : <a href="http://solydxk.com/">http://solydxk.com/</a></p>', 1595932672, '2015-02-01 13:26:34', 'solydx64_201501.iso.torrent', 'solydxk.png', 395),
(52, 'Frugalware-2.0-full-x86_64', 'mumbly', 'frugalware-2-0-full-x86-64', '<p><strong>Frugalware</strong> est une distribution Linux d''origine hongroise &agrave; vocation g&eacute;n&eacute;raliste cr&eacute;&eacute;e par Mikl&oacute;s Vajna et con&ccedil;ue pour des utilisateurs de niveau interm&eacute;diaire/moyen (qui ne sont pas effray&eacute;s par un terminal de commande). Elle est bas&eacute;e sur Slackware dont elle partage l''esprit &laquo;&nbsp;UNIX-like&nbsp;&raquo;, mais qu''elle am&eacute;liore au niveau de la gestion et de la mise &agrave; jours automatique des paquets tout en conservant ses qualit&eacute;s de robustesse et de l&eacute;g&egrave;ret&eacute;. Elle utilise par ailleurs une version modifi&eacute;e du gestionnaire de paquets Pacman, d''Arch Linux.</p>', '<p><strong><span class="Quote">Frugalware 2.0 (Rigel)</span></strong></p>\r\n<ul>\r\n<li><span class="Quote">Linux kernel 3.14.19</span></li>\r\n<li><span class="Quote">X.Org Server 1.15.2</span></li>\r\n<li><span class="Quote">KDE 4.14.3</span></li>\r\n<li><span class="Quote">GNOME 3.12.2</span></li>\r\n<li><span class="Quote">Xfce 4.10.1</span></li>\r\n<li><span class="Quote">LXDE 0.99.0</span></li>\r\n<li><span class="Quote">LibreOffice 4.3.3</span></li>\r\n<li><span class="Quote">Mozilla Firefox 35.0.1</span></li>\r\n<li><span class="Quote">Chromium browser 39.0.2171.96</span></li>\r\n<li><span class="Quote">New features: MATE 1.8.1</span></li>\r\n</ul>\r\n<p>Infos : <a href="http://frugalware.org/">http://frugalware.org/</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/frugalware-small.png" alt="" width="480" height="384" /></p>', 1962432512, '2015-02-20 06:55:59', 'fvbe-2.0-full-x86_64.iso.torrent', 'frugalware.png', 369),
(43, 'Raspbian-2015-01-30', 'mumbly', 'raspbian-2015-01-30', '<p>Raspbian est un syst&egrave;me d''exploitation libre bas&eacute; sur Debian GNU/Linux et optimis&eacute; pour le mat&eacute;riel Raspberry Pi (le processeur de l''architecture armhf). Raspbian est livr&eacute; avec plus de 35 000 paquets, ou des logiciels pr&eacute;-compil&eacute;s et livr&eacute;s dans un format permettant une installation facile sur un Raspberry Pi. La construction initiale a &eacute;t&eacute; achev&eacute;e en Juin 2012, mais la distribution continue d''&ecirc;tre activement d&eacute;velopp&eacute;e avec un accent mis sur l''am&eacute;lioration de la stabilit&eacute; et les performances d''autant de paquets Debian que possible.</p>', '<p><em><strong>Version</strong></em> :&nbsp;janvier<strong>&nbsp;</strong>2015<br /> <em><strong>Date de release</strong></em>&nbsp;:&nbsp;31 janvier 2015<br /> <em><strong>Default login</strong></em> :&nbsp;pi / raspberry<br /> <strong><em>Version du kernel</em></strong> :&nbsp;3.18<br /> <em><strong>Release notes</strong></em> :&nbsp;<a href="http://downloads.raspberrypi.org/raspbian/release_notes.txt">Lien</a><br /> <em><strong>Format</strong></em>&nbsp;: ZIP<br /> <em><strong>Infos</strong></em> :&nbsp;<a href="http://www.raspberrypi.org/">http://www.raspberrypi.org/</a></p>\r\n<p>&nbsp;</p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/raspbian-small.png" alt="" width="480" height="259" /></p>', 1024431943, '2015-02-03 10:03:29', '2015-01-31-raspbian.zip.torrent', 'raspbian.png', 474),
(44, 'Simplicity-Linux-Desktop-15.1', 'tornzen', 'simplicity-linux-desktop-15-1', '<p>Simplicit&eacute; Linux est d&eacute;riv&eacute; de Puppy Linux avec LXDE comme environnement de bureau par d&eacute;faut. Il se d&eacute;cline en quatre &eacute;ditions: Obsidian, Netbook, Desktop et M&eacute;dias. L''&eacute;dition Netbook propose des logiciels disponibles sur le Cloud, l''&eacute;dition&nbsp;Desktop offre une collection de logiciels &agrave; usage g&eacute;n&eacute;ral, et la variante M&eacute;dias est con&ccedil;ue pour fournir aux utilisateurs de PC un acc&egrave;s facile &agrave; tous leurs m&eacute;dias.</p>', '<p>Infos :&nbsp;<a href="http://simplicitylinux.org/">http://simplicitylinux.org/</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/simplicity-small.png" alt="" width="480" height="384" /></p>', 473923584, '2015-02-05 10:42:54', 'Desktop151Final.iso.torrent', 'simplicity.png', 635),
(49, 'manjaro-xfce-0.8.12-x86_64', 'mumbly', 'manjaro-xfce-0-8-12-x86-64', '<p>Manjaro Linux, ou tout simplement Manjaro (prononc&eacute; comme dans Kilimanjaro), est une distribution Linux utilisant XFCE comme interface utilisateur par d&eacute;faut. C''est d''abord un syst&egrave;me d''exploitation libre pour ordinateurs personnels qui sait rester simple d''utilisation tout en mettant &agrave; disposition la richesse de la communaut&eacute; Arch Linux. Il utilise par ailleurs un mod&egrave;le de d&eacute;veloppement similaire &agrave; sa grande s&oelig;ur, de type rolling release.</p>', '<p><strong>Version 64 bits XFCE 0.8.12</strong></p>\r\n<p>Infos : <a href="http://www.manjaro.org">http://www.manjaro.org</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/manjaro-small.png" alt="" width="480" height="384" /></p>', 1480048640, '2015-02-09 17:23:23', 'manjaro-xfce-0.8.12-x86_64.iso.torrent', 'Manjaro-logo.png', 466);
INSERT INTO `blog_posts_seo` (`postID`, `postTitle`, `postAuthor`, `postSlug`, `postDesc`, `postCont`, `postTaille`, `postDate`, `postTorrent`, `postImage`, `postViews`) VALUES
(48, 'korora-21-x86_64-xfce-live', 'mumbly', 'korora-21-x86-64-xfce-live', '<p>Korora est n&eacute; d''un d&eacute;sir de rendre Linux plus facile pour les nouveaux utilisateurs, tout en &eacute;tant utile pour les experts. L''objectif principal de Korora est de fournir un syst&egrave;me complet, facile &agrave; utiliser pour l''informatique en g&eacute;n&eacute;ral. Initialement bas&eacute;e sur Gentoo Linux en 2005, Korora rena&icirc;t en 2010 en s''appuyant sur&nbsp;Fedora avec des r&eacute;glages et des fonctionnalit&eacute;s qui permettent d''utiliser le syst&egrave;me "tel quel"..</p>', '<p>Infos :&nbsp;<a href="https://kororaproject.org/">https://kororaproject.org/</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://i1-news.softpedia-static.com/images/news2/Korora-21-Xfce-Edition-Screenshot-Tour-472760-2.jpg" alt="" width="480" height="360" /></p>', 1799356416, '2015-02-09 17:09:00', 'korora-21-x86_64-xfce-live.iso.torrent', 'korora.png', 408),
(50, 'netrunner-15-Prometheus-dvd-64bit', 'mumbly', 'netrunner-15-prometheus-dvd-64bit', '<p>Netrunner est une distribution bas&eacute;e sur Kubuntu proposant un bureau KDE hautement personnalis&eacute; avec des applications suppl&eacute;mentaires, codecs multim&eacute;dias, Flash et Java plugins et un look unique. Les modifications visent &agrave; am&eacute;liorer la convivialit&eacute; de l''environnement de bureau tout en pr&eacute;servant la libert&eacute; de modifier les r&eacute;glages &agrave; votre guise. Une &eacute;dition s&eacute;par&eacute;e "Rolling Release", bas&eacute; sur Linux Manjaro (base de Arch Linux), a &eacute;t&eacute; lanc&eacute;e en 2014.</p>', '<p>Blue Systems, la soci&eacute;t&eacute; qui sponsorise &eacute;galement la version KDE de Linux Mint et Kubuntu, d&eacute;veloppe Netrunner comme un bureau pr&eacute;vu pour une utilisation quotidienne bas&eacute;e sur Plasma Desktop, le bureau KDE. Ce syst&egrave;me d''exploitation cible aussi bien les nouveaux utilisateurs que les utilisateurs exp&eacute;riment&eacute;s avec GNU/Linux.</p>\r\n<p>Le bureau Plasma permet une personnalisation facile pour configurer l''interface &agrave; votre go&ucirc;t.</p>\r\n<p>Depuis la version 4.2, Netrunner est compos&eacute; de nouveaux logiciels et outils de configuration KDE pour une meilleure int&eacute;gration des services web tels que Google, Facebook etowncloud. Cela permet &agrave; l''utilisateur de visualiser, &eacute;diter et stocker ses donn&eacute;es comme les documents ou les calendriers dans l''environnement KDE et d''int&eacute;grer la messagerie instantan&eacute;e de Google ou Facebook avec KDE Telepathy.</p>\r\n<p>Netrunner est disponible en versions 32 bits et 64 bits.</p>\r\n<p>Netrunner est bas&eacute; sur Kubuntu qui est une version d''Ubuntu avec l''environnement KDE SC. Ubuntu est lui bas&eacute; sur Debian.</p>\r\n<p>Infos :&nbsp;<a href="http://www.netrunner-os.com/">http://www.netrunner-os.com/</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/netrunner-small.png" alt="" width="480" height="384" /></p>', 1925185536, '2015-02-16 08:47:25', 'netrunner-15-dvd-64bit.iso.torrent', 'netrunner.png', 541),
(51, 'antergos-2015.01.11-x86_64', 'mumbly', 'antergos-2015-01-11-x86-64', '<p>Antergos est un syst&egrave;me d''exploitation moderne, &eacute;l&eacute;gant et puissant bas&eacute; sur Arch Linux. Il a commenc&eacute; sa vie sous le nom de Cinnarch, combinant l&rsquo;environnement de bureau Cinnamon avec la distribution Arch Linux, mais le projet a &eacute;volu&eacute; dans ses objectifs initiaux et offre maintenant un choix de plusieurs environnements de bureau, y compris GNOME 3 (par d&eacute;faut), Cinnamon, Razor-qt et Xfce. Antergos fournit &eacute;galement son propre programme d''installation graphique.</p>', '<p>Infos :&nbsp;<a href="http://antergos.com/">http://antergos.com/</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/antergos-small.png" alt="" width="480" height="384" /></p>', 870318080, '2015-02-16 09:09:58', 'antergos-2015.01.11-x86_64.iso.torrent', 'antergos.png', 542),
(53, 'openSUSE-13.2-NET-x86_64', 'mumbly', 'opensuse-13-2-net-x86-64', '<p><strong><span class="lang-en" lang="en" xml:lang="en">open</span><span class="lang-de" lang="de" xml:lang="de">SUSE</span></strong> est une distribution Linux majeure d''origine allemande. C''est une distribution communautaire soutenue par <span class="lang-de" lang="de" xml:lang="de">SUSE</span> et d''autres sponsors. Elle est l''h&eacute;riti&egrave;re de l''historique &laquo;&nbsp;<span class="lang-de" lang="de" xml:lang="de">SUSE</span> Linux <span class="lang-en" lang="en" xml:lang="en">Professionnal</span>&nbsp;&raquo; et sert aujourd''hui de base aux produits <span class="lang-de" lang="de" xml:lang="de">SUSE</span> Linux <span class="lang-en" lang="en" xml:lang="en">Enterprise</span>. <span id="result_box" class="" lang="fr"><span class="hps">Le projet</span> <span class="hps">openSUSE</span> <span class="hps">est</span> <span class="hps">un programme communautaire</span> <span class="hps">sponsoris&eacute; par</span> <span class="hps">Novell</span>. <span class="hps">Promouvoir l''utilisation de</span> <span class="hps">Linux</span> <span class="hps">partout,</span> <span class="hps">ce programme</span> <span class="hps">offre un acc&egrave;s gratuit</span> <span class="hps">facile &agrave;</span> <span class="hps">openSUSE</span>, <span class="hps">une distribution</span> <span class="hps">Linux compl&egrave;te</span>.</span></p>', '<p>Version 13.2 NET Edition - 64 bits</p>\r\n<p>Infos : <a href="http://www.opensuse.org/">http://www.opensuse.org/</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/suse-small.png" alt="" width="480" height="384" /></p>', 82837504, '2015-02-22 08:31:02', 'openSUSE-13.2-NET-x86_64.iso.torrent', 'suse.png', 356),
(54, 'archbang-150210-x86_64', 'mumbly', 'archbang-150210-x86-64', '<p>ArchBang est un excellent moyen d''obtenir un bureau Linux minimal mais tr&egrave;s fonctionnel avec OpenBox. Bas&eacute;e sur Archlinux, cette distib utilise lesd&eacute;p&ocirc;ts ArchLinux et comprend un outil d''installation en plein &eacute;cran tr&egrave;s agr&eacute;able. Le nom est inspir&eacute; par CrunchBang qui est une Debian OpenBox rapide et minimal...</p>', '<p>Infos : <a href="http://www.archbang.org/">http://www.archbang.org/</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/archbang-small.png" alt="" width="480" height="384" /></p>', 436207616, '2015-02-22 12:39:52', 'archbang-150210-x86_64.iso.torrent', 'archbang.png', 665),
(55, 'tails-i386-1.3', 'mumbly', 'tails-i386-1-3', '<p>Tails est un syst&egrave;me d''exploitation complet destin&eacute; &agrave; &ecirc;tre utilis&eacute; depuis un DVD, une clef USB ou une carte SD ind&eacute;pendamment du syst&egrave;me install&eacute; sur l''ordinateur. C''est un logiciel libre bas&eacute; sur Debian GNU/Linux.<br /> Tails est un syst&egrave;me live dont le but est de pr&eacute;server votre vie priv&eacute;e et votre anonymat. Il vous permet d''utiliser Internet de mani&egrave;re anonyme et de contourner la censure quasiment partout o&ugrave; vous allez et sur n''importe quel ordinateur. Tails ne laisse aucune trace de ce que vous avez fait, sauf si vous le demandez explicitement.</p>', '<p>Tails est livr&eacute; avec de nombreuses applications, configur&eacute;es avec une attention particuli&egrave;re accord&eacute;e &agrave; la s&eacute;curit&eacute; : navigateur web, client de messagerie instantan&eacute;e, client email, suite bureautique, &eacute;diteur d''image et de son, etc.</p>\r\n<p>Tails d&eacute;pend du r&eacute;seau d''anonymisation de Tor pour prot&eacute;ger votre vie priv&eacute;e en ligne :</p>\r\n<ul>\r\n<li>tous les logiciels sont configur&eacute;s de mani&egrave;re &agrave; se connecter &agrave; Internet via Tor</li>\r\n<li>si une application tente de se connecter &agrave; Internet directement, la connexion est automatiquement bloqu&eacute;e pour des raisons de s&eacute;curit&eacute;.</li>\r\n</ul>\r\n<p>Tor est un logiciel libre et un r&eacute;seau ouvert qui vous aide &agrave; vous d&eacute;fendre contre une forme de surveillance qui menace les libert&eacute;s individuelles et la vie priv&eacute;e, les activit&eacute;s et relations professionnelles confidentielles, et la s&eacute;curit&eacute; d''&Eacute;tat connue sous le nom d''analyse de trafic</p>\r\n<p>Tor vous prot&egrave;ge en faisant transiter vos communications au sein d''un r&eacute;seau distribu&eacute; de relais h&eacute;berg&eacute;s par des volontaires partout dans le monde : il emp&ecirc;che quiconque observant votre connexion Internet de savoir quels sites vous visitez, et il emp&ecirc;che le site que vous visitez de savoir o&ugrave; vous vous trouvez.</p>\r\n<p>En utilisant Tor vous pouvez :</p>\r\n<ul>\r\n<li>&ecirc;tre anonyme en ligne, en cachant votre emplacement,</li>\r\n<li>vous connecter &agrave; des services qui seraient censur&eacute;s sinon&nbsp;;</li>\r\n<li>r&eacute;sister &agrave; des attaques qui bloquent l''utilisation de Tor, gr&acirc;ce &agrave; des outils de contournement tels que les <a href="https://tails.boum.org/doc/first_steps/startup_options/bridge_mode/index.fr.html">bridges</a>.</li>\r\n</ul>\r\n<p>L''utilisation de Tails ne modifie pas le syst&egrave;me d''exploitation install&eacute; sur l''ordinateur. Vous pouvez donc l''utiliser que vous soyez chez vous, chez un ami ou &agrave; la biblioth&egrave;que du coin. Une fois votre DVD, clef USB ou carte SD Tails retir&eacute;e de l''ordinateur, celui-ci peut red&eacute;marrer sur le syst&egrave;me d''exploitation habituel.</p>\r\n<p>Tails est sp&eacute;cialement configur&eacute; pour ne pas utiliser le disque dur de l''ordinateur, pas m&ecirc;me l''espace swap. Le seul espace de stockage utilis&eacute; par Tails est la m&eacute;moire RAM, qui est effac&eacute;e automatiquement &agrave; l''extinction de l''ordinateur. Vous ne laisserez donc aucune trace, que ce soit du syst&egrave;me Tails ou de ce que vous avez fait, sur l''ordinateur. C''est pourquoi nous le qualifions d''"amn&eacute;sique".</p>\r\n<p>Cela vous permet de travailler sur un document sensible sur n''importe quel ordinateur tout en emp&ecirc;chant la r&eacute;cup&eacute;ration de ces donn&eacute;es une fois l''ordinateur &eacute;teint. Bien s&ucirc;r, vous pouvez toujours sauvegarder vos documents sur une clef USB ou un disque dur externe afin de les garder pour une prochaine utilisation.</p>\r\n<p>Tails comprend &eacute;galement une s&eacute;lection d''outils de protection de donn&eacute;es utilisant un chiffrement robuste:</p>\r\n<ul>\r\n<li>\r\n<p><a href="https://tails.boum.org/doc/encryption_and_privacy/encrypted_volumes/index.fr.html">Chiffrez votre cl&eacute; USB ou votre disque dur externe</a> avec <span class="definition"><a href="https://en.wikipedia.org/wiki/Linux%5FUnified%5FKey%5FSetup">LUKS</a></span>, le standard de Linux en mati&egrave;re de chiffrement de volume.</p>\r\n</li>\r\n<li>\r\n<p>Chiffrez automatiquement en HTTPS toutes vos communications vers de nombreux sites web en utilisant <a href="https://www.eff.org/https-everywhere">HTTPS Everywhere</a>, une extension Firefox d&eacute;velopp&eacute;e par la <a href="https://www.eff.org">Electronic Frontier Foundation</a>.</p>\r\n</li>\r\n<li>\r\n<p>Chiffrez et signez vos emails et documents depuis le client mail de Tails, l''&eacute;diteur de texte ou le navigateur de fichiers gr&acirc;ce au standard <em>de facto</em> <span class="definition"><a href="https://secure.wikimedia.org/wikipedia/fr/wiki/OpenPGP">OpenPGP</a></span>.</p>\r\n</li>\r\n<li>\r\n<p>Prot&eacute;gez vos conversations par messagerie instantan&eacute;e en utilisant <span class="definition"><a href="https://en.wikipedia.org/wiki/Off%2Dthe%2DRecord%5FMessaging">OTR</a></span>, un outil cryptographique qui fournit chiffrement, authentification ainsi que la possibilit&eacute; du d&eacute;ni plausible.</p>\r\n</li>\r\n<li>\r\n<p><a href="https://tails.boum.org/doc/encryption_and_privacy/secure_deletion/index.fr.html">Supprimez vos fichiers de fa&ccedil;on s&ucirc;re</a> et nettoyez votre espace disque gr&acirc;ce &agrave; <a href="http://wipetools.tuxfamily.org/nautilus-wipe.html">Nautilus Wipe</a>.</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;Infos : <a href="https://tails.boum.org/">https://tails.boum.org/</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/tails-small.png" alt="" width="480" height="384" /></p>', 954132480, '2015-02-25 13:41:03', 'tails-i386-1.3.iso.torrent', 'Tails-Logo.jpg', 627),
(56, 'Voyager-14.04.04-i386', 'mumbly', 'voyager-14-04-04-i386', '<p>Voyager est une distribution traditionnellement bas&eacute;e sur Xubuntu, avec l''environnement de bureau Xfce. Ses caract&eacute;ristiques comprennent le navigateur Avant Window ou AWN (une barre de navigation dock-like), Conky (un programme qui affiche des informations utiles sur le bureau), et plus de 300 photographies et des animations qui peuvent &ecirc;tre utilis&eacute;s comme fonds d''&eacute;cran...</p>', '<p>Plus d''info sur :&nbsp;<a href="http://voyagerlive.org/index.php/live-voyager-14-04-04-lts/">http://voyagerlive.org/index.php/live-voyager-14-04-04-lts/</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://voyagerlive.org/wp-content/uploads/2015/03/01.jpeg" alt="" width="480" height="270" /></p>', 984387584, '2015-03-11 09:13:54', 'Voyager-14.04.04-i386.iso.torrent', 'voyager.png', 1813),
(57, 'Voyager-14.04.04-amd64', 'mumbly', 'voyager-14-04-04-amd64', '<p>Voyager est une distribution traditionnellement bas&eacute;e sur Xubuntu, avec l''environnement de bureau Xfce. Ses caract&eacute;ristiques comprennent le navigateur Avant Window ou AWN (une barre de navigation dock-like), Conky (un programme qui affiche des informations utiles sur le bureau), et plus de 300 photographies et des animations qui peuvent &ecirc;tre utilis&eacute;s comme fonds d''&eacute;cran...</p>', '<p>Infos :&nbsp;<a href="http://voyagerlive.org/index.php/live-voyager-14-04-04-lts/">http://voyagerlive.org/index.php/live-voyager-14-04-04-lts/</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://voyagerlive.org/wp-content/uploads/2015/03/01.jpeg" alt="" width="480" height="270" /></p>', 1008664576, '2015-03-11 09:15:29', 'Voyager-14.04.04-amd64.iso.torrent', 'voyager.png', 2233),
(58, 'Voyager-X-14.04.04-amd64.iso', 'mumbly', 'voyager-x-14-04-04-amd64-iso', '<p><strong>Voyager X est bas&eacute; sur Voyager 14.04.04 LTS.&nbsp;</strong>C''est une version exp&eacute;rimentale construite autour du nouveau bureau<strong> Xfce 4.12</strong> qui vient de sortir et du <strong>noyau kernel 3.16</strong>. Toute la structure voyager a &eacute;t&eacute; recod&eacute;e au propre, les scripts am&eacute;lior&eacute;s pour accueillir le nouveau xfce 4.12 . Une version X qui a pour but de rendre enfin disponible les derni&egrave;res am&eacute;liorations de xfce et du kernel pour les machines r&eacute;centes. Sachant que xfce 4.12 est en version finale mais n''&eacute;tant pas encore int&eacute;gr&eacute;e &agrave; ubuntu officiel sinon par son ppa, cette version se classera donc comme exp&eacute;rimentale. Seule une iso 64 bits sera disponible et apr&egrave;s une 32 bits si les retours sont concluants. Voyager X a &eacute;t&eacute; test&eacute; sans probl&egrave;me et donc peut s''installer comme pour l''officiel Voyager. Xfce 4.12 coupl&eacute; au kernel 3.16, Voyager en devient plus r&eacute;actif et rapide, les param&eacute;trages plus affin&eacute;s, le mat&eacute;riel mieux pris en compte.</p>', '<p>Voyager est une distribution traditionnellement bas&eacute;e sur Xubuntu, avec l''environnement de bureau Xfce. Ses caract&eacute;ristiques comprennent le navigateur Avant Window ou AWN (une barre de navigation dock-like), Conky (un programme qui affiche des informations utiles sur le bureau), et plus de 300 photographies et des animations qui peuvent &ecirc;tre utilis&eacute;s comme fonds d''&eacute;cran...</p>\r\n<p>Infos :&nbsp;<a href="http://voyagerlive.org/index.php/live-voyager-x/">http://voyagerlive.org/index.php/live-voyager-x/</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://a.fsdn.com/con/app/proj/voyagerlive/screenshots/voyager1.jpeg" alt="" width="480" height="270" /></p>', 1047488512, '2015-03-30 10:18:12', 'Voyager-X-14.04.04-amd64.iso.torrent', 'voyager.png', 1646),
(59, 'Emmabuntus-3-14.04.2-1.01-i686', 'shihtzu', 'emmabuntus-3-14-04-2-1-01-i686', '<p style="margin-bottom: 0cm;"><strong><a href="https://fr.wikipedia.org/wiki/Emmabunt&uuml;s">Emmabunt&uuml;s</a></strong>&nbsp;est une distribution Linux de bureau bas&eacute;e sur Xubuntu. Elle est accessible aux d&eacute;butants et raisonnablement l&eacute;g&egrave;re en ressources pour &ecirc;tre utilis&eacute;e sur de vieux ordinateurs. Elle inclut un grand nombre de programmes modernes pr&eacute;-configur&eacute;s pour une utilisation quotidienne, une barre de lancement d''applications, une installation ais&eacute;e de logiciels non-libres et codecs multimedias, des scripts pour une installation rapide.</p>', '<p><img style="display: block; margin-left: auto; margin-right: auto;" src="https://upload.wikimedia.org/wikipedia/commons/thumb/4/42/Emmabuntus-3-14.04-Desktop.png/750px-Emmabuntus-3-14.04-Desktop.png?uselang=fr" alt="Emmabunt&uuml;s 3 14.04" width="750" height="600" /></p>\r\n<p>&nbsp;</p>\r\n<p>Pour cette version 1.01, les correctifs et am&eacute;liorations suivants ont &eacute;t&eacute; apport&eacute;s&nbsp;:</p>\r\n<ul>\r\n<li>\r\n<p style="margin-bottom: 0cm;">Base <a href="http://fr.wikipedia.org/wiki/Xubuntu">Xubuntu</a> <a href="http://fr.wikipedia.org/wiki/Xubuntu#Nouveaut.C3.A9s_de_Xubuntu_14.04">14.04.2</a></p>\r\n</li>\r\n<li>\r\n<p style="margin-bottom: 0cm;">Mise &agrave; jour des plugins pour Firefox, Chromium, Thunderbird</p>\r\n</li>\r\n<li>\r\n<p style="margin-bottom: 0cm;">Mise &agrave; jour de l''extension LTools 2.8 dans Libre Office</p>\r\n</li>\r\n<li>\r\n<p style="margin-bottom: 0cm;">Correction de la non installation des fontes Calibri</p>\r\n</li>\r\n<li>\r\n<p style="margin-bottom: 0cm;">Ajout de FreeTuxTV</p>\r\n</li>\r\n<li>\r\n<p style="margin-bottom: 0cm;">Ajout de Minitube</p>\r\n</li>\r\n<li>\r\n<p style="margin-bottom: 0cm;">Ajout de smb4k</p>\r\n</li>\r\n<li>\r\n<p style="margin-bottom: 0cm;">Ajout de la cat&eacute;gorie Accessibilit&eacute; contenant Virtual Magnifier Glass, ainsi d''un script simplifiant la personnalisation du curseur</p>\r\n</li>\r\n<li>\r\n<p>Correction de basculement du clavier en QWERTY suite &agrave; l''installation. Afin d''&eacute;viter ce probl&egrave;me voir cet <a href="http://emmabuntus.sourceforge.net/mediawiki/index.php/F.A.Q/fr#Comment_installer_Emmabunt.C3.BCs_3_sans_avoir_le_probl.C3.A8me_du_clavier_QWERTY">article</a> de notre FAQ</p>\r\n</li>\r\n</ul>\r\n<p><br />Nous vous conseillons afin de garantir une installation correcte d''Emmabunt&uuml;s de faire l''installation sans &ecirc;tre raccord&eacute; &agrave; internet, et de vous connecter seulement lors du premier red&eacute;marrage de la machine pour l''installation (ou pas) des logiciels non libres, voir l''article sur l''<a href="http://linux.developpez.com/tutoriels/emmabuntus-installation/">installation d''Emmabunt&uuml;s 3</a> sur le site de <a href="http://linux.developpez.com/">Developpez.com</a>.</p>\r\n<p><br />Nous attirons votre attention sur le fait qu''il y a encore quelques probl&egrave;mes avec les cartes graphiques comme la <a href="http://ubuntuforums.org/showthread.php?t=2220588&amp;p=13006437#post13006437">Nvidia C61 GeForce 6150SE nForce 430</a> avec laquelle vous devez absolument utiliser le pilote propri&eacute;taire sinon l''&eacute;cran se fige, et nous vous conseillons de d&eacute;sactiver le fond d''&eacute;cran pendant l''installation, voir cet <a href="http://emmabuntus.sourceforge.net/mediawiki/index.php/F.A.Q/fr#Blocage_de_l.27installation_ou_de_l.27utilisation_d.27Emmabunt.C3.BCs_3_avec_une_carte_graphique_Nvidia">article</a> de notre FAQ.</p>\r\n<p>Annonce compl&egrave;te <strong><a href="http://emmabuntus.sourceforge.net/mediawiki/index.php/Mars_30th,_2015,_Emmabuntus_3_celebrates_the_Freedom_Feast/fr">ici</a></strong>.</p>', 3784673280, '2015-03-30 22:46:37', 'Emmabuntus3-desktop-14.04.2-1.01.iso.torrent', 'Libere_par_Emmabuntus_3.png', 625),
(60, 'Emmabuntus-3-14.04.2-1.01-amd64', 'shihtzu', 'emmabuntus-3-14-04-2-1-01-amd64', '<p style="margin-bottom: 0cm;"><strong><a href="https://fr.wikipedia.org/wiki/Emmabunt&uuml;s">Emmabunt&uuml;s</a></strong>&nbsp;est une distribution Linux de bureau bas&eacute;e sur Xubuntu. Elle est accessible aux d&eacute;butants et raisonnablement l&eacute;g&egrave;re en ressources pour &ecirc;tre utilis&eacute;e sur de vieux ordinateurs. Elle inclut un grand nombre de programmes modernes pr&eacute;-configur&eacute;s pour une utilisation quotidienne, une barre de lancement d''applications, une installation ais&eacute;e de logiciels non-libres et codecs multimedias, des scripts pour une installation rapide.</p>', '<p>&nbsp;</p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="https://upload.wikimedia.org/wikipedia/commons/thumb/4/42/Emmabuntus-3-14.04-Desktop.png/600px-Emmabuntus-3-14.04-Desktop.png" alt="Emmabunt&uuml;s 3 14.04" width="600" height="480" /></p>\r\n<p>Pour cette version 1.01, les correctifs et am&eacute;liorations suivants ont &eacute;t&eacute; apport&eacute;s&nbsp;:</p>\r\n<ul>\r\n<li>\r\n<p style="margin-bottom: 0cm;">Base <a href="http://fr.wikipedia.org/wiki/Xubuntu">Xubuntu</a> <a href="http://fr.wikipedia.org/wiki/Xubuntu#Nouveaut.C3.A9s_de_Xubuntu_14.04">14.04.2</a></p>\r\n</li>\r\n<li>\r\n<p style="margin-bottom: 0cm;">Mise &agrave; jour des plugins pour Firefox, Chromium, Thunderbird</p>\r\n</li>\r\n<li>\r\n<p style="margin-bottom: 0cm;">Mise &agrave; jour de l''extension LTools 2.8 dans Libre Office</p>\r\n</li>\r\n<li>\r\n<p style="margin-bottom: 0cm;">Correction de la non installation des fontes Calibri</p>\r\n</li>\r\n<li>\r\n<p style="margin-bottom: 0cm;">Ajout de FreeTuxTV</p>\r\n</li>\r\n<li>\r\n<p style="margin-bottom: 0cm;">Ajout de Minitube</p>\r\n</li>\r\n<li>\r\n<p style="margin-bottom: 0cm;">Ajout de smb4k</p>\r\n</li>\r\n<li>\r\n<p style="margin-bottom: 0cm;">Ajout de la cat&eacute;gorie Accessibilit&eacute; contenant Virtual Magnifier Glass, ainsi d''un script simplifiant la personnalisation du curseur</p>\r\n</li>\r\n<li>\r\n<p>Correction de basculement du clavier en QWERTY suite &agrave; l''installation. Afin d''&eacute;viter ce probl&egrave;me voir cet <a href="http://emmabuntus.sourceforge.net/mediawiki/index.php/F.A.Q/fr#Comment_installer_Emmabunt.C3.BCs_3_sans_avoir_le_probl.C3.A8me_du_clavier_QWERTY">article</a> de notre FAQ</p>\r\n</li>\r\n</ul>\r\n<p><br />Nous vous conseillons afin de garantir une installation correcte d''Emmabunt&uuml;s de faire l''installation sans &ecirc;tre raccord&eacute; &agrave; internet, et de vous connecter seulement lors du premier red&eacute;marrage de la machine pour l''installation (ou pas) des logiciels non libres, voir l''article sur l''<a href="http://linux.developpez.com/tutoriels/emmabuntus-installation/">installation d''Emmabunt&uuml;s 3</a> sur le site de <a href="http://linux.developpez.com/">Developpez.com</a>.</p>\r\n<p><br />Nous attirons votre attention sur le fait qu''il y a encore quelques probl&egrave;mes avec les cartes graphiques comme la <a href="http://ubuntuforums.org/showthread.php?t=2220588&amp;p=13006437#post13006437">Nvidia C61 GeForce 6150SE nForce 430</a> avec laquelle vous devez absolument utiliser le pilote propri&eacute;taire sinon l''&eacute;cran se fige, et nous vous conseillons de d&eacute;sactiver le fond d''&eacute;cran pendant l''installation, voir cet <a href="http://emmabuntus.sourceforge.net/mediawiki/index.php/F.A.Q/fr#Blocage_de_l.27installation_ou_de_l.27utilisation_d.27Emmabunt.C3.BCs_3_avec_une_carte_graphique_Nvidia">article</a> de notre FAQ.</p>\r\n<p>Annonce compl&egrave;te <strong><a href="http://emmabuntus.sourceforge.net/mediawiki/index.php/Mars_30th,_2015,_Emmabuntus_3_celebrates_the_Freedom_Feast/fr">ici</a></strong>.</p>', 3962642432, '2015-03-30 22:57:49', 'Emmabuntus3-desktop-amd64-14.04.2-1.01.iso.torrent', 'Libere_par_Emmabuntus_3.png', 509),
(61, 'handylinux-1.9-wheezy', 'mumbly', 'handylinux-1-9-wheezy', '<p><strong>HandyLinux</strong> est une distribution Linux francophone et anglophone de la famille des d&eacute;riv&eacute;es officielles de Debian. Elle est con&ccedil;ue pour les d&eacute;butants en informatique, les seniors &eacute;quip&eacute;s de vieux ordinateurs devenus trop lents sous Windows et ceux qui veulent se lib&eacute;rer de Microsoft.<br /> Les utilisateurs participent &agrave; son am&eacute;lioration en proposant sur le forum des modifications et de nouvelles fonctionnalit&eacute;s qui sont ensuite int&eacute;gr&eacute;es par le d&eacute;veloppeur.</p>', '<p>Cette version est bas&eacute;e sur Debian-7-Wheezy et s''adresse aux personnes ne souhaitant pas passer en v2 ou n''en ayant pas besoin... car ici, c''est HandyLinux, pas m$ ou la pomme ... on va pas vous obliger &agrave; passer en version sup&eacute;rieure <img src="http://blog.handylinux.org/plugins/plxeditor/plxeditor/smilies/wink.png" alt="" /> . HandyLinux-1.9 sera donc maintenue aussi longtemps que Debian Wheezy (un an minimum).</p>\r\n<p><strong>HandyLinux-1.9 ne demande aucune r&eacute;-installation</strong> pour les utilisateurs des versions 1.8 et ant&eacute;rieures. Effectuez simplement les mises &agrave; jour depuis votre gestionnaire de mise &agrave; jour.</p>\r\n<p><strong>HandyLinux-1.9 int&egrave;gre quelques nouveaut&eacute;s de la v2</strong>, dont la fusion des version 486 et 686-pae : plus besoin de choisir son ISO, HandyLinux le fait pour vous <img src="http://blog.handylinux.org/plugins/plxeditor/plxeditor/smilies/smile.png" alt="" /> . Voici le changelog complet :</p>\r\n<ul>\r\n<li>fusion des version 486 et 686-pae avec int&eacute;gration du script de nettoyage du noyau inutile</li>\r\n<li>passage de Skype en option avec un installeur simplifi&eacute;</li>\r\n<li>refonte graphique du site et mise &agrave; jour des liens</li>\r\n<li>int&eacute;gration du handylinuxlook tout en gardant l''interface v1.8 par d&eacute;faut</li>\r\n<li>d&eacute;finition de ''handylinux" comme hostname par d&eacute;faut</li>\r\n<li>mises &agrave; jour Debian</li>\r\n</ul>\r\n<p>Plus d''infos : <a href="http://v2.handylinux.org/documentation/doku.php/obtenir_handylinux">http://v2.handylinux.org/documentation/doku.php/obtenir_handylinux</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/handy-small.png" alt="" width="480" height="384" /></p>', 1275445248, '2015-04-11 15:44:39', 'handylinux-1.9-wheezy.iso.torrent', 'handy.png', 348),
(62, 'Toutou-SlaXen-6.0_RCX_NoPAE', 'mumbly', 'toutou-slaxen-6-0-rcx-nopae', '<p>Toutou Linux est une adaptation francophone de la distribution Puppy Linux, con&ccedil;ue pour &ecirc;tre simple d''utilisation et conviviale. C''est un syst&egrave;me d''exploitation complet pour un usage familial compatible avec les vieux ordinateurs. Il se charge enti&egrave;rement en RAM et est tr&egrave;s rapide. Les d&eacute;veloppeurs ont choisi le gestionnaire de fen&ecirc;tres Openbox accompagn&eacute; de la barre des t&acirc;ches LXPanel et le navigateur web Opera. Toutou Linux inclut OCI, une application sur mesure pour automatiser l''installation. Un assistant de premier d&eacute;marrage permet de personnaliser la distribution : activer le pav&eacute; num&eacute;rique, changer le type de clavier, modifier l''affichage des menus, installer une imprimante ou un scanner, ajouter des logiciels</p>', '<p>Version 6.0 SlaXen 6.0 RCX Non PAE</p>\r\n<p>Noyau Linux 3.4.94</p>\r\n<p>Je vous propose Toutou SlaXen 6.0 RCX Non PAE, bas&eacute;e sur l''excellent travail de 01Micko : Slacko 6.0 b&eacute;ta.</p>\r\n<p>Soyez prudent avant d''utiliser vos fichiers de sauvegarde pr&eacute;c&eacute;dents.</p>\r\n<p>Le gestionnaire des fen&ecirc;tres Openbox 3.5.2 associ&eacute; &agrave; Lxpanel 0.6.1, vous accueille sur le bureau.</p>\r\n<p>Quelques changements sur le bureau.</p>\r\n<p>Vous rerouverez les ic&ocirc;nes habituelles mais une barre verticale sur le c&ocirc;t&eacute; gauche permet de lancer les programmes alors qu''une application est ouverte en plein &eacute;cran.</p>\r\n<p>Pour les petits &eacute;crans, vous pourrez configurer de masquer ou non cette barre. Et pour ceux qui le souhaitent, afficher un bureau vierge d''ic&ocirc;nes.</p>\r\n<p>Il n''y a pas de navigateur Internet "impos&eacute;", mais le choix d''en installer un (ou plus) parmi six, d&egrave;s le d&eacute;marrage. De m&ecirc;me vous devrez t&eacute;l&eacute;charger le greffon Flashplayer d''un clic de souris.</p>\r\n<p>Vous retrouverez bien &eacute;videmment toutes les applications habituelles.</p>\r\n<p>Et des nouveaut&eacute;s ou des mises &agrave; jour : mtPaint 3.44.90, Foxit reader 1.1, Abiword 3.0, Gnumeric 1.10.0</p>\r\n<p>D&egrave;s l''acc&egrave;s au bureau, vous pouvez installer des programmes sous la forme de paquets PET, ou sous la forme de fichiers SFS (pour certains) apr&egrave;s enregistrement de votre session.</p>\r\n<p>Voici la liste de 32 applications (en ordre alphab&eacute;tique), au choix, &agrave; installer d''un clic par l''utilitaire de t&eacute;l&eacute;chargement et d''installation de SlaXen et disponibles sur le site de Toutou :</p>\r\n<p>Amaya, Amule, Audacious, Audacity, Avidemux, Bluefish, Clementine, Cinelerra, Deadbeef, Firefox, Fotoxx, FreeOffice, Gimp, Grisbi, Gtkyoutubeviewer, Guvcview, Homebank, Lazpaint, LibreOffice, Ohmig&eacute;n&eacute;, OOlight, Opera, Palemoon, Pidgin, Polices de Libreoffice, Qupzilla et libqtWebkit, Seamonkey, Skype, Slimboat, Songbird, VLC, Viewnior, XnView.</p>\r\n<p>Une s&eacute;rie d''utilitaires pratiques de rcrsn51 : PeasyGlue, PeasyScale, Peasyscan, Yassm 2.6, peasyport 2.0.</p>\r\n<p>Compression (de Don570), un utilitaire pour compresser rapidement des dossiers.</p>\r\n<p>Frisbee 2.6 et Rapidradio une interface simple pour &eacute;couter quelques radios du Web. S''il y en a qui veulent la rendre param&eacute;trable ... voil&agrave; un petit travail pour vous occuper.</p>\r\n<p>Cette version est plus adapt&eacute;e aux machines r&eacute;centes, mais elle peut aussi faire le bonheur d''anciens PC, avec au moins 256 Mo de RAM et un fichier d''&eacute;change de 512 Mo.</p>\r\n<h2>Remarque :</h2>\r\n<p>Pour la mise &agrave; jour d''une version ant&eacute;rieure, &eacute;vitez, il n''y a aucune compatibilit&eacute;.</p>\r\n<p>Infos : <a href="http://toutoulinux.free.fr/index.php">http://toutoulinux.free.fr/index.php</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://a.fsdn.com/con/app/proj/toutoulinux/screenshots/SlaXen.jpg" alt="" width="480" height="384" /></p>', 195035136, '2015-04-14 20:51:15', 'SlaXen-6.0_RCX_NoPAE.iso.torrent', 'toutou_splash.jpg', 826),
(63, 'debian-8.0.0-amd64-DVD-1', 'mumbly', 'debian-8-0-0-amd64-dvd-1', '<p>Apr&egrave;s presque 24 mois de d&eacute;veloppement constant, le projet Debian est fier d''annoncer sa nouvelle version stable 8 (nom de code <q>Jessie</q>), qui sera g&eacute;r&eacute;e pour les 5 prochaines ann&eacute;es gr&acirc;ce &agrave; l''effort combin&eacute; de l''&eacute;quipe de s&eacute;curit&eacute; de Debian ainsi qu''&agrave; celui de l''&eacute;quipe de gestion &agrave; long terme de Debian.</p>\r\n<p><q>Jessie</q> est livr&eacute;e avec un nouveau syst&egrave;me d''initialisation par d&eacute;faut nomm&eacute; systemd. La suite systemd&gt; fournit plusieurs fonctionnalit&eacute;s excitantes telles qu''un temps de d&eacute;marrage raccourci, les cgroups pour les services ou encore la possibilit&eacute; d''isoler une partie des services. Le syst&egrave;me d''initialisation sysvinit est toujours disponible pour <q>Jessie</q>.</p>', '<p>Debian est un syst&egrave;me d''exploitation libre, d&eacute;velopp&eacute; par des milliers de volontaires provenant du monde entier qui collaborent via Internet. Les forces essentiels du projet Debian sont sa base volontaire, son d&eacute;vouement au Contrat Social de Debian et au Logiciel Libre ainsi que son engagement &agrave; fournir le meilleur syst&egrave;me d''exploitation possible. Debian 8 est un nouveau pas important dans ce sens.</p>\r\n<p>La mise &agrave; niveau vers Debian 8 &agrave; partir de la version pr&eacute;c&eacute;dente (Debian 7 nom de code <q>Wheezy</q>) est g&eacute;r&eacute;e automatiquement par l''outil de gestion de paquets apt-get pour la plupart des configurations. Comme toujours, les syst&egrave;mes Debian peuvent &ecirc;tre mis &agrave; niveau sans douleur et sans p&eacute;riode d''indisponibilit&eacute; forc&eacute;e, mais il est fortement recommand&eacute; de lire les <a href="https://www.debian.org/releases/jessie/releasenotes">notes de publication</a> ainsi que le <a href="https://www.debian.org/releases/jessie/installmanual">guide d''installation</a> pour d''&eacute;ventuels probl&egrave;mes et pour des instructions d&eacute;taill&eacute;s sur l''installation et la mise &agrave; niveau. Les notes de publications seront am&eacute;lior&eacute;es et traduites dans les semaines suivant la publication.</p>\r\n<p>Version : 64 bits</p>\r\n<p>Infos : <a href="http://www.debian.org">http://www.debian.org</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/debian-small.png" alt="" width="480" height="384" /></p>', 3976200192, '2015-04-26 10:23:27', 'debian-8.0.0-amd64-DVD-1.iso.torrent', 'debian.jpg', 592),
(64, 'PrimTux-2015-04-26', 'Steph', 'primtux-2015-04-26', '<p>PrimTux est une distribution &eacute;ducative fran&ccedil;aise compl&egrave;te destin&eacute;e &agrave; l''&eacute;cole primaire. Elle est bas&eacute;e sur Debian Jessie et d&eacute;velopp&eacute;e en coop&eacute;ration avec la communaut&eacute; ASRI Education.</p>', '<p>PrimTux<br /><br />PrimTux est une distribution &eacute;ducative bas&eacute;e sur Debian Jessie adapt&eacute;e &agrave; l''&eacute;cole primaire.<br />Elle dispose d''un syst&egrave;me de cat&eacute;gorisation et d''&eacute;dition simplifi&eacute; des raccourcis, supporte les multi-utilisateurs (int&eacute;gr&eacute; dans la version live, &agrave; installer dans le cas d''une utilisation sur disque dur).<br />Le menu utilis&eacute; est celui de PCManFM agr&eacute;ment&eacute; des marque-pages pour distinguer les diff&eacute;rentes cat&eacute;gories.<br />L''installation est simple, utilise systemback (https://sourceforge.net/projects/systemback/), ce qui permet de cr&eacute;er facilement ensuite sa propre distribution: systemback installe si on est en live, et propose sauvegarde et cr&eacute;ation de syst&egrave;mes live si on est dans le cas d''une version install&eacute;e.<br /><br />- Version live et installable sur syst&egrave;mes PAE et non PAE<br />- Base: Debian jessie<br />- Bureau: fluxbox + rox.<br />- Logiciels &eacute;ducatifs install&eacute;s:<br />&nbsp;&nbsp; -Lecture : aller, associations,exercices Beaunis, exercices.free, imageo, le jeu du pendu , le mot le plus long<br />&nbsp;&nbsp; -Calcul : &agrave; nous les nombres, calcul mental, calcul r&eacute;fl&eacute;chi, calculatrice, calculette capricieuse, contour, exercices.free, fukubi, la course aux nombres, le matou matheux, le nombre cible, op&eacute;rations, probl&egrave;mes, suites, suites arithm&eacute;tiques, tierce, tuxmaths<br />&nbsp;&nbsp; -Clavier-souris : Jnavigue , mulot, pysycache<br />&nbsp;&nbsp; -Compilations : childsplay, gcompris, omnitux, pepit, pysiogame, Jclic<br />&nbsp;&nbsp; -Dessin : tuxpaint<br />&nbsp;&nbsp; -D&eacute;couverte du monde : Atlas Houot<br />&nbsp;&nbsp; -G&eacute;om&eacute;trie : chemin, epi: labyrinthe, labyrinthe cach&eacute;, comparaison, piles, symcolor, g&eacute;otortue , tangrams<br />&nbsp;&nbsp; -Sciences : Stellarium, microscope virtuel, Scratch<br />- Jeux: blobby volley, frozen-bubble, Hannah''s horse, monsterz, Mr Patate, ri-li, seahorse adventures, supertux.<br />- Pour le ma&icirc;tre: Ardora, open sankor&eacute;, pylote, l''administration de tuxpaint, de gcompris, de pysycache, Jclic author<br />- Bureautique : OOO4Kids, Dicorime<br />- Graphisme : Mirage, Pinta, Shutter<br />- Internet : filezilla, seamonkey<br />- Son et vid&eacute;o : audacity, winff, soundconverter, vlc, gmplayer, xfburn<br /><br />- Poids: 3,1 go / 6,1 go install&eacute;e - Consommation RAM: 80 mo au chargement( version install&eacute;e) / 90 mo au chargement (version live). 256 mo de ram (et swap de 1.5 fois la ram, habituel sous linux) sont conseill&eacute;s pour la faire tourner correctement.</p>', 3127398400, '2015-04-28 10:27:59', 'PrimTux-2015-04-26.iso.torrent', 'icone.150.png', 301),
(65, 'Debian-8.0.0- 32 bits (i386)', 'JeanLouis_76', 'debian-8-0-0-32-bits-i386', '<p>Debian est un syst&egrave;me d''exploitation libre, d&eacute;velopp&eacute; par des milliers de volontaires provenant du monde entier qui collaborent via Internet. Les forces essentiels du projet Debian sont sa base volontaire, son d&eacute;vouement au Contrat Social de Debian et au Logiciel Libre ainsi que son engagement &agrave; fournir le meilleur syst&egrave;me d''exploitation possible. Debian 8 est un nouveau pas important dans ce sens.</p>', '<p>Cette distribution Linux int&egrave;gre &eacute;galement de base un bon nombre de logiciels pr&eacute;-install&eacute;s. Debian est la distribution Linux la plus recommand&eacute;e &agrave; ceux qui souhaitent mieux comprendre l''univers Linux<br /><br />Vous pouvez essayer Debian en amor&ccedil;ant un syst&egrave;me autonome &agrave; partir d''un CD, d''un DVD ou d''une clef USB sans installer un seul fichier sur l''ordinateur. Une fois pr&ecirc;t, vous pouvez ex&eacute;cuter l''installateur inclus. Si l''image est compatible avec vos d&eacute;sirs en terme de taille, langue et s&eacute;lection de paquets, cette m&eacute;thode pourrait vous convenir.&nbsp; <a href="https://www.debian.org/CD/live/#choose_live" target="_blank">A propos de cette m&eacute;thode </a></p>\r\n<p>Apr&egrave;s environ 24 mois de d&eacute;veloppement constant,Debian est fier de pr&eacute;senter sa nouvelle version stable 8 (nom de code "Jessie"), prise en charge pour les prochaines cinq ann&eacute;es gr&acirc;ce au travail combin&eacute; de l''&eacute;quipe de s&eacute;curit&eacute; Debian et l''&eacute;quipe de support &agrave; long terme <br /><br />&nbsp;"Jessie" embarque un nouveau syst&egrave;me de d&eacute;marrage par d&eacute;faut : systemd. La suite systemd offre de nombreuses fonctionnalit&eacute;s int&eacute;ressantes comme un meilleur temps de d&eacute;marrage, des groupes de contr&ocirc;le pour les services, et la possibilit&eacute; d''isoler une partie des services. Le syst&egrave;me de d&eacute;marrage sysvinit est encore disponible dans "Jessie"<br /><br />C''est aussi l''occasion de tirer un trait sur l''obsol&egrave;te protocole SSLv3, d&eacute;sactiv&eacute; au sein de cette nouvelle branche. Les applications et les biblioth&egrave;ques qui l''exploitaient ont toutes &eacute;t&eacute; mises &agrave; jour. Debian se dote &eacute;galement de nouveaux outils charg&eacute;s d''alerter en cas de paquet insuffisamment maintenu sur le plan de la s&eacute;curit&eacute;, ou de veiller au bon red&eacute;marrage de services reposant sur des paquets mis &agrave; jour<br /><br />Au c&oelig;ur de Debian, on trouve le kernel Linux 3.16.7-ckt9. Si certains se posent la question d&rsquo;une version aussi &laquo; ancienne &raquo; du noyau, on rappellera que sa philosophie&nbsp; est avant tout la stabilit&eacute;. On n&rsquo;y trouve que rarement la derni&egrave;re r&eacute;vision d&rsquo;un paquet , ce qui explique par exemple pourquoi les branches ESR (support &eacute;tendu) de Firefox et Thunderbird ont &eacute;t&eacute; pr&eacute;f&eacute;r&eacute;es : une Debian est faite pour durer</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;"><img style="float: left;" src="http://www.spcnet.it/wp-content/uploads/2015/04/0-220x162.jpg" alt="" width="220" height="162" /><img style="float: right;" src="http://www.netfox2.net/modules/wfdownloads/images/screenshots/Debian.jpg" alt="" width="217" height="163" /></p>\r\n<p style="text-align: center;"><a href="https://www.debian.org/" target="_blank">Infos g&eacute;n&eacute;rales</a></p>\r\n<p style="text-align: center;"><a href="https://www.debian.org/releases/stable/errata" target="_blank">Un soucis ?</a></p>\r\n<p style="text-align: center;"><a href="https://www.debian.org/releases/jessie/releasenotes" target="_blank">Notes de publication&nbsp; </a></p>\r\n<p style="text-align: center;"><a href="https://www.debian.org/releases/jessie/installmanual" target="_blank">Guides installation </a></p>\r\n<p style="text-align: center;">&nbsp;</p>', 546308096, '2015-04-30 15:49:04', 'debian-live-8.0.0-i386-standard.iso.torrent', 'debian.jpg', 469),
(66, 'elementary OS-Freya 0.3-amd64', 'JeanLouis_76', 'elementary-os-freya-0-3-amd64', '<p>elementary OS a un unique but : fournir la meilleure exp&eacute;rience pour notre communaut&eacute;. Anim&eacute;s par l&rsquo;envie de proposer le meilleur du libre pour ses utilisateurs, elementary OS est un syst&egrave;me d&rsquo;exploitation qui a pour vocation d&rsquo;offrir une alternative puissante, stable et design aux distributions Linux d&eacute;j&agrave; existante.</p>', '<p>Nous croyons en la force de l&rsquo;open source et en la collaboration globale. Ce qui signifie que n&rsquo;importe qui peut t&eacute;l&eacute;charger, utiliser, modifier, et contribuer. Le code source d&rsquo;exploitation entier est libre, ainsi que ses applications. Tous le monde peut ainsi aider les d&eacute;veloppeurs &agrave; corriger des bugs, proposer des am&eacute;liorations. Ainsi nos d&eacute;veloppeurs et la communaut&eacute; toute enti&egrave;re sera l&agrave; lorsque vous d&eacute;ploierez elementary OS sur votre ordinateur.<br /><br />Design, sobre et Fonctionnel<br />Est con&ccedil;ue avant tout par des d&eacute;veloppeurs au talent de designers. Pour eux, les ordinateurs doivent &ecirc;tre simples d&rsquo;utilisation, amusants, et joli. En donnant une importance de premier ordre au design, nous nous assurons de r&eacute;pondre aux qualit&eacute;s premi&egrave;res de Linux, &agrave; savoir un syst&egrave;me d&rsquo;exploitation stable, des applications a qualit&eacute;, une multitude de fonctionnalit&eacute;s diverses et vari&eacute;es.</p>\r\n<p>Une alternative gratuite &agrave; Windows et &agrave; Mac OS X. Elle vient avec juste ce que vous attendez, comme un navigateur web rapide, des applications natives : calculatrice, lecteur de musiques et de vid&eacute;os, un agenda, un bloc-note et surtout un store avec des milliers d&rsquo;applications. Tout en restant un syst&egrave;me d&rsquo;exploitation solide bas&eacute; sur la distribution GNU/Linux : Ubuntu<br /><br />Rapide<br />Freya a &eacute;t&eacute; con&ccedil;ue d&egrave;s le d&eacute;part pour &ecirc;tre l&eacute;g&egrave;re comme une plume. Elle d&eacute;marre rapidement, lance une session instantan&eacute;ment, et utilise le strict minimum au niveau ressources afin que vos applications puissent profiter de ce gain de rapidit&eacute;. Avec Freya, vous disposez d&rsquo;une base Linux d&eacute;j&agrave; puissante et l&eacute;g&egrave;re pouvant &ecirc;tre install&eacute;e sur de vieux ordinateur comme des machines &agrave; la pointe de la technologie.<br /><br />Pleine de fonctionnalit&eacute;s<br />Quand vous installez elementary OS, vous n&rsquo;installez pas juste un syst&egrave;me d&rsquo;exploitation. Vous installez une excellente suite d&rsquo;applications taill&eacute;es sur mesure pour vous. Surfer facilement sur internet, checkez vos mails, planifiez des rendez-vous sur votre calendrier &ldquo;connect&eacute;&rdquo;, &eacute;coutez de la musique, regardez vos films pr&eacute;f&eacute;r&eacute;s, jouez &agrave; des jeux vid&eacute;os (Steam). Utilisez un ordinateur devient un v&eacute;ritable plaisir tant il est simple et beau.<br /><br />S&ucirc;re et S&eacute;curis&eacute;e<br />Freya est construite sur la base solide de la fondation Linux.N&rsquo;ayant pas de virus connus, aucun programme antivirus emb&ecirc;tant faisant ralentir votre syst&egrave;me n&rsquo;est n&eacute;cessaire. Freya re&ccedil;oit des mises &agrave; jour de s&eacute;curit&eacute; d&egrave;s qu&rsquo;un probl&egrave;me est d&eacute;couvert, ce qui signifie qu&rsquo;il n&rsquo;y a pas d&rsquo;attente,rendant le syst&egrave;me le plus s&eacute;curis&eacute;.</p>\r\n<p>&nbsp;</p>\r\n<p>Infos globales&nbsp;&nbsp; <a href="http://www.elementaryos-fr.org/">elementary Os </a></p>\r\n<p>&nbsp;</p>\r\n<p><img src="https://elementary.io/images/notebook.png" alt="" width="446" height="271" /><img style="float: right;" src="http://www.elementaryos-fr.org/wp-content/uploads/2013/08/SwitchBoard-269x174.png" alt="" width="421" height="254" /></p>', 893386752, '2015-05-02 08:47:30', 'elementaryos-freya-amd64.iso.torrent', 'Elementary.jpg', 520);
