(67, 'elementary OS - Freya 0.3 - i386', 'JeanLouis_76', 'elementary-os-freya-0-3-i386', '<p>elementary OS a un unique but : fournir la meilleure exp&eacute;rience pour notre communaut&eacute;. Anim&eacute;s par l&rsquo;envie de proposer le meilleur du libre pour ses utilisateurs, elementary OS est un syst&egrave;me d&rsquo;exploitation qui a pour vocation d&rsquo;offrir une alternative puissante, stable et design aux distributions Linux d&eacute;j&agrave; existante.</p>', '<p>Nous croyons en la force de l&rsquo;open source et en la collaboration globale. Ce qui signifie que n&rsquo;importe qui peut t&eacute;l&eacute;charger, utiliser, modifier, et contribuer. Le code source d&rsquo;exploitation entier est libre, ainsi que ses applications. Tous le monde peut ainsi aider les d&eacute;veloppeurs &agrave; corriger des bugs, proposer des am&eacute;liorations. Ainsi nos d&eacute;veloppeurs et la communaut&eacute; toute enti&egrave;re sera l&agrave; lorsque vous d&eacute;ploierez elementary OS sur votre ordinateur.<br /><br />Design, sobre et Fonctionnel<br />Est con&ccedil;ue avant tout par des d&eacute;veloppeurs au talent de designers. Pour eux, les ordinateurs doivent &ecirc;tre simples d&rsquo;utilisation, amusants, et joli. En donnant une importance de premier ordre au design, nous nous assurons de r&eacute;pondre aux qualit&eacute;s premi&egrave;res de Linux, &agrave; savoir un syst&egrave;me d&rsquo;exploitation stable, des applications a qualit&eacute;, une multitude de fonctionnalit&eacute;s diverses et vari&eacute;es.<br /><br />Une alternative gratuite &agrave; Windows et &agrave; Mac OS X. Elle vient avec juste ce que vous attendez, comme un navigateur web rapide, des applications natives : calculatrice, lecteur de musiques et de vid&eacute;os, un agenda, un bloc-note et surtout un store avec des milliers d&rsquo;applications. Tout en restant un syst&egrave;me d&rsquo;exploitation solide bas&eacute; sur la distribution GNU/Linux : Ubuntu<br /><br />Rapide<br />Freya a &eacute;t&eacute; con&ccedil;ue d&egrave;s le d&eacute;part pour &ecirc;tre l&eacute;g&egrave;re comme une plume. Elle d&eacute;marre rapidement, lance une session instantan&eacute;ment, et utilise le strict minimum au niveau ressources afin que vos applications puissent profiter de ce gain de rapidit&eacute;. Avec Freya, vous disposez d&rsquo;une base Linux d&eacute;j&agrave; puissante et l&eacute;g&egrave;re pouvant &ecirc;tre install&eacute;e sur de vieux ordinateur comme des machines &agrave; la pointe de la technologie.<br /><br />Pleine de fonctionnalit&eacute;s<br />Quand vous installez elementary OS, vous n&rsquo;installez pas juste un syst&egrave;me d&rsquo;exploitation. Vous installez une excellente suite d&rsquo;applications taill&eacute;es sur mesure pour vous. Surfer facilement sur internet, checkez vos mails, planifiez des rendez-vous sur votre calendrier &ldquo;connect&eacute;&rdquo;, &eacute;coutez de la musique, regardez vos films pr&eacute;f&eacute;r&eacute;s, jouez &agrave; des jeux vid&eacute;os (Steam). Utilisez un ordinateur devient un v&eacute;ritable plaisir tant il est simple et beau.<br /><br />S&ucirc;re et S&eacute;curis&eacute;e<br />Freya est construite sur la base solide de la fondation Linux.N&rsquo;ayant pas de virus connus, aucun programme antivirus emb&ecirc;tant faisant ralentir votre syst&egrave;me n&rsquo;est n&eacute;cessaire. Freya re&ccedil;oit des mises &agrave; jour de s&eacute;curit&eacute; d&egrave;s qu&rsquo;un probl&egrave;me est d&eacute;couvert, ce qui signifie qu&rsquo;il n&rsquo;y a pas d&rsquo;attente,rendant le syst&egrave;me le plus s&eacute;curis&eacute;.<br /><br />&nbsp;<br /><br />Infos globales&nbsp;&nbsp;&nbsp;<a href="http://www.elementaryos-fr.org/" target="_blank">elementary Os</a>&nbsp; </p>\r\n<p>&nbsp;</p>\r\n<p><img src="http://www.elementaryos-fr.org/wp-content/uploads/2013/08/elementary-os-expose.png" alt="" width="440" height="258" /><img style="float: right;" src="http://www.elementaryos-fr.org/wp-content/uploads/2013/08/SwitchBoard.png" alt="" width="440" height="258" /></p>', 872415232, '2015-05-02 09:06:06', 'elementaryos-freya-i386.iso.torrent', 'Elementary.jpg', 355),
(68, 'LinuxConsole 2.4 beta2', 'linuxconsole', 'linuxconsole-2-4-beta2', '<p>Le but initial de<strong> LinuxConsole</strong>&nbsp; est de transformer des ordinateurs en console de jeux.L&rsquo;usage principal qui en est r&eacute;element fait, est de recycler des ordinateurs avec un syst&egrave;me d&rsquo;exploitation r&eacute;cent et l&eacute;ger.<br /> Le bureau LXDE comprend des utiltaires et des scripts qui permettent d&rsquo;installer Firefox 34, Flash et Google Chrome.Il est aussi possible de param&eacute;trer des imprimantes.<br />En bonus, vous trouverez un gestionnaire de paquets l&eacute;ger, qui permet de compl&eacute;ter la liste de logiciels d&eacute;j&agrave; disponibles parmi les cat&eacute;gories suivantes :</p>\r\n<ul>\r\n<li>Jeux</li>\r\n<li>Bureautique</li>\r\n<li>Utilitaires</li>\r\n<li>Graphisme</li>\r\n<li>&Eacute;ducation</li>\r\n</ul>', '<p>Version 2.4 beta2</p>\r\n<ul>\r\n<li>on&nbsp;peut&nbsp;cr&eacute;er&nbsp;un&nbsp;utilisateur</li>\r\n<li>nouveau th&egrave;me</li>\r\n<li>kernel 4.0.1, xorg-server-1.16.4</li>\r\n<li>rajout locales russe&nbsp;et&nbsp;chinois</li>\r\n</ul>', 711137280, '2015-05-02 23:05:29', 'linuxconsole-2.4-beta2-x86.iso.torrent', 'cropped-linuxconsole.png', 284),
(69, 'LinuxConsole 2.4 beta3', 'linuxconsole', 'linuxconsole-2-4-beta3', '<p><em><strong>A propos de LinuxConsole :</strong></em></p>\r\n<ul>\r\n<li>Distribution Linux l&eacute;g&egrave;re (bureau LXDE) et rapide</li>\r\n<li>Contient un noyau, des librairires et des logiciels r&eacute;cents</li>\r\n<li>Peut &ecirc;tre utilis&eacute;e comme&nbsp; liveCD, liveDVD, liveUSB</li>\r\n<li>Peut &ecirc;tre install&eacute;e sur un disque dur (en dual boot ou sur un disque vierge)</li>\r\n<li>Acc&eacute;l&eacute;ration 2D/3D pour la plupart des cartes vid&eacute;os</li>\r\n</ul>', '<h2>Nouveaut&eacute;s</h2>\r\n<ul>\r\n<li>Traductions Chinoises et Russes</li>\r\n<li>Possibilit&eacute; de cr&eacute;er des comptes utilisateur</li>\r\n<li>Noyau 4.0.1</li>\r\n<li>Xorg 1.16.4</li>\r\n<li>Mesa 10.5.4</li>\r\n<li>Les versions de firefox du plugin sont synchronis&eacute;es sur celles d&rsquo;Arch Linux</li>\r\n<li>Chrome et Firefox simples &agrave;&nbsp; installer, qupzilla est le navigateur web par d&eacute;faut</li>\r\n<li>apt-get wrapper (Ex : apt-get install pinball)</li>\r\n<li>Kdelibs (4.14.6) pr&eacute;-install&eacute;s</li>\r\n<li>Nouveau theme</li>\r\n<li>Disponible en CD (lxde + network manager + qupzilla + all libraries + supertuxkart) et DVD</li>\r\n<li>/opt est maintenant persistant (utile pour les logiciels tiers comme google earth)</li>\r\n</ul>\r\n<h2>Packages (Sur le DVD/R&eacute;seau)</h2>\r\n<ul>\r\n<li>VLC</li>\r\n<li>Filezilla</li>\r\n<li>Libreoffice</li>\r\n<li>Gcompris, Kgeography, tuxpaint</li>\r\n<li>Gimp, Inkscape</li>\r\n<li>Wine, Lutris</li>\r\n<li>De nombreux&nbsp; jeux (0ad-0.0.18_alpha, aisleriot, Extremetuxracer, frozen-bubble, hedgewars, ksudoku, neverball, supertuxkart, teeworlds, wesnoth)</li>\r\n</ul>', 8430516579, '2015-05-09 11:21:39', 'linuxconsole-2.4-beta3.torrent', 'cropped-linuxconsole.png', 252),
(71, 'pfSense-LiveCD-2.2.3-RELEASE-amd64', 'mumbly', 'pfsense-livecd-2-2-3-release-amd64', '<p><strong>pfSense</strong> est un routeur/pare-feu open source bas&eacute; sur le syst&egrave;me d''exploitation FreeBSD. A l''origine d''un fork de m0n0wall, il utilise le pare-feu &agrave; &eacute;tats Packet Filter, des fonctions de routage et de NAT lui permettant de connecter plusieurs r&eacute;seaux informatiques. Il comporte l''&eacute;quivalent libre des outils et services utilis&eacute;s habituellement sur des routeurs professionnels propri&eacute;taires. pfSense convient pour la s&eacute;curisation d''un r&eacute;seau domestique ou de petite entreprise.<br /> Apr&egrave;s une br&egrave;ve installation manuelle pour assigner les interfaces r&eacute;seaux, il s''administre ensuite &agrave; distance depuis l''interface web et g&egrave;re nativement les VLAN (802.1q).<br /> Comme sur les distributions Linux, pfSense int&egrave;gre aussi un gestionnaire de paquets pour installer des fonctionnalit&eacute;s suppl&eacute;mentaires, comme un proxy, serveur VoIP...</p>', '<p>Pour info :&nbsp;<a href="http://www.pfsense.org/">http://www.pfsense.org/</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/pfsense-small.png" alt="" width="480" height="436" /></p>', 87216400, '2015-06-29 13:42:39', 'pfSense-LiveCD-2.2.3-RELEASE-amd64.torrent', 'pfsense.png', 174),
(70, 'Mageia-5-dual-DVD', 'mumbly', 'mageia-5-dual-dvd', '<p>Mageia 5 est une distribution GNU/Linux pour votre ordinateur, r&eacute;alis&eacute;e par la <a href="http://www.mageia.org/fr/community">communaut&eacute; Mageia</a>. Elle peut &ecirc;tre install&eacute;e de diff&eacute;rentes mani&egrave;res. L''utilisation d''iso Live ou Classique &eacute;tant les plus populaire.<br /> Mageia 5 inclut diff&eacute;rents environnement de bureau, parmi eux, KDE, GNOME, XFCE, Mate ou Cinnamon. Version "Dual-Arch"</p>', '<p>Magiea est en m&ecirc;me temps une Communaut&eacute; et une Distribution Linux, Mageia5 &eacute;tant notre cinqui&egrave;me version.</p>\r\n<p>Il y''a de nombreuses nouveaut&eacute;s dans Mageia 5, trop pour les &eacute;num&eacute;rer ici. Consultez les <a href="https://wiki.mageia.org/en/Mageia_5_Release_Notes">notes de publication</a> pour une liste exhaustive.</p>\r\n<p>Il y a une fonctionnalit&eacute; importante &agrave; mentionner ici. Cela a demand&eacute; beaucoup d''efforts et de temps mais &ccedil;a en valait la peine. Mageia 5 <a href="https://blog.mageia.org/fr/2015/05/30/en-attendant-mageia-5-focus-sur-le-support-de-luefi/">supporte l''UEFI</a>, ce qui signifie qu''elle est maintenant plus facile &agrave; installer sur des ordinateurs r&eacute;cents.</p>\r\n<p>Afin d''aider les utilisateurs &agrave; configurer et utiliser Mageia, mais aussi pour donner des informations &agrave; propos de la communaut&eacute; et du projet, <a href="https://wiki.mageia.org/en/Feature:MageiaWelcome">MageiaWelcome</a> a &eacute;t&eacute; d&eacute;velopp&eacute;. Ce programme d&eacute;marre automatiquement lors de la premi&egrave;re ouverture de session dans n''importe lequel des environnements graphiques.</p>\r\n<p>Infos : <a href="http://www.mageia.org">http://www.mageia.org</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/mageia-small.png" alt="" width="480" height="384" /></p>', 1288699904, '2015-06-20 08:06:28', 'Mageia-5-dual-DVD.iso.torrent', 'mageia.png', 225),
(72, 'Linux Mint Debian Edition-cinnamon-64bit', 'mumbly', 'linux-mint-debian-edition-cinnamon-64bit', '<p>Linux Mint est un syst&egrave;me d''exploitation GNU/Linux bas&eacute; sur Ubuntu, et con&ccedil;u pour les ordinateurs individuels au m&ecirc;me titre que Windows ou Mac OS. Il s''affirme comme un &laquo; syst&egrave;me moderne, &eacute;l&eacute;gant et confortable1. &Agrave; la fois puissant et facile d''utilisation &raquo;. Linux Mint est la distribution Linux la plus t&eacute;l&eacute;charg&eacute;e (selon DistroWatch, 2015)2 et le 3e syst&egrave;me d''exploitation le plus utilis&eacute; au monde[r&eacute;f. n&eacute;cessaire].<br />La devise de la distribution est &laquo; From freedom came elegance &raquo;, ce qu''on peut adapter en fran&ccedil;ais par : &laquo; De la libert&eacute; naquit l''&eacute;l&eacute;gance &raquo;.<br />La particularit&eacute; de cette distribution Linux gratuite r&eacute;side dans le fait qu''elle inclut d''origine &ndash; en plus de logiciels libres &ndash; des logiciels non-libres (c''est-&agrave;-dire privateurs), ce qui concourt &agrave; la faire exclure3 des distributions recommand&eacute;es par la Free Software Foundation4.<br />Linux Mint b&eacute;n&eacute;ficie de mises &agrave; jour majeures tous les six mois ainsi que d''une nouvelle version tous les deux ans.</p>', '<p><em><strong>VERSION</strong></em> :&nbsp;Linux Mint Debian Edition 2 "Betsy" - Cinnamon (64-bit)</p>\r\n<p>Pour info :&nbsp;<a href="http://www.linuxmint.com/">http://www.linuxmint.com/</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/mint-small.png" alt="" width="480" height="384" /></p>', 1572438016, '2015-06-30 11:09:43', 'lmde-2-201503-cinnamon-64bit.iso.torrent', 'mint.png', 164),
(73, 'SupertuxKart Remix 0.9-0.73', 'lgame', 'supertuxkart-remix-0-9-0-73', '<p>(English below)<br />SuperTuxKart est un jeu de course de karting avec Tux comme h&eacute;ros et d''autres mascottes de logiciels libres (Le gnou de Gnu, Gimp, Suzanne de blender, Xue la souris d''XFCE, etc). <br />SuperTuxKart Remix 0.9-0.73 est un DVD(/USB) bas&eacute; sur LinuxConsole 2.4 et comprenant diverses versions de SupertuxKart de 0.73 &agrave; 0.9. Le DVD est multilingue (fran&ccedil;ais, anglais, allemand,italien au moins). C''est une collaboration entre l''association LanPower et Yann Ledoar&eacute; de LinuxConsole. C''est un DVD multimodal avec donc une partie Live DVD (ou DVD autonome).<br />English :</p>\r\n<p>SuperTuxKart is a kart racing game with Tux as heroes and other mascots from free open source software (the gnou from Gnu, Gimp, Suzanne from blender, Xue the mouse from XFCE, and so on).<br />SuperTuxKart Remix 0.9-0.73 is a DVD(/USB) based upon LinuxConsole 2.4 and containing various versions of SupertuxKart from 0.73 to 0.9. This DVD is multilingual (french, english, deutsch,italian at least). It is a collaborative work between LanPower association and Yann Ledoar&eacute; from LinuxConsole. It is a multimodal DVD with a Live DVD part (or autonomous DVD ).</p>', '<p>(English below)<br />SuperTuxKart est un jeu de course de karting avec Tux comme h&eacute;ros et d''autres mascottes de logiciels libres (Le gnou de Gnu, Gimp, Suzanne de blender, Xue la souris d''XFCE, etc). <br />SuperTuxKart Remix 0.9-0.73 est un DVD(/USB) bas&eacute; sur LinuxConsole 2.4 et comprenant diverses versions de SupertuxKart de 0.73 &agrave; 0.9. Le DVD est multilingue (fran&ccedil;ais, anglais, allemand,italien au moins). C''est une collaboration entre l''association LanPower et Yann Ledoar&eacute; de LinuxConsole. C''est un DVD multimodal avec donc une partie Live DVD (ou DVD autonome).<br />Nous y avons rajout&eacute; :<br />- dans le r&eacute;pertoire binaries : les installeurs SupertuxKart 0.9 pour Windows de XP &agrave; 8. SupertuxKart 0.73 est disponible pour des raisons de compatibilit&eacute; avec Windows 2000 mais aussi pour les machines peu performantes. Dans ce r&eacute;pertoire, vous trouverez aussi les binaires pour Linux (fichier .tar.gz) et pour MacOSX (fichier .dmg).<br />- dans le r&eacute;pertoire data : se trouvent la video officielle de SupertuxKart 0.9, ainsi que diverses autres video, le poster officiel, des papiers peints et des &eacute;tiquettes pour CD/DVD.<br />- une interface utilisateur multilingue se lance automatiquement sous Windows (sinon lancer windows.bat). Cette interface fonctionne (parfois) aussi sous Linux gr&acirc;ce &agrave; Wine (lancer "bash linux.sh").</p>\r\n<p>Pour r&eacute;sumer : au moins trois utilisations possibles :<br />- sans syst&egrave;me d''exploitation : d&eacute;marrer sur le DVD (choix "Live CD") ou sur la cl&eacute; USB (choix "Live USB")<br />- sous Windows : ex&eacute;cution automatique ou lancer windows.bat<br />- sous Linux : utiliser le binaire tar.gz de SupertuxKart 0.9 fourni dans le r&eacute;pertoire binaries, ou d&eacute;marrer l''interface Windows par linux.sh (bien s&ucirc;r, vous n''avez pas besoin de &ccedil;a si SupertuxKart 0.9 figure dans les d&eacute;p&ocirc;ts de votre distribution et que vous avez internet).</p>\r\n<p>Site officiel :&nbsp;<a href="http://supertuxkart.sourceforge.net/">http://supertuxkart.sourceforge.net/</a></p>\r\n<p>LinuxConsole web site :&nbsp;<a href="http://www.linuxconsole.org">http://www.linuxconsole.org</a></p>\r\n<p>Association LanPower web site :&nbsp;<a href="http://asso.lanpower.free.fr">http://asso.lanpower.free.fr</a></p>\r\n<p>English :</p>\r\n<p>SuperTuxKart is a kart racing game with Tux as heroes and other mascots from free open source software (the gnou from Gnu, Gimp, Suzanne from blender, Xue the mouse from XFCE, and so on).<br />SuperTuxKart Remix 0.9-0.73 is a DVD(/USB) based upon LinuxConsole 2.4 and containing various versions of SupertuxKart from 0.73 to 0.9. This DVD is multilingual (french, english, deutsch,italian at least). It is a collaborative work between LanPower association and Yann Ledoar&eacute; from LinuxConsole. It is a multimodal DVD with a Live DVD part (or autonomous DVD ).<br />We have added different stuff :<br />- in the binaries directory : SupertuxKart 0.9 set up software for Windows from XP to 8. SupertuxKart 0.73 is available for compatibility reasons with Windows 2000 but also for low performance computers. In that directory, you will find binaries for Linux (.tar.gz file) and for MacOSX ( .dmg file).<br />- in the data directory : official video trailer of SupertuxKart 0.9 and various videos, wall papers, official poster, CD label and DVD box cover.<br />- a multilingual Graphic User interface is provided and automatically launched under Windows (otherwise launch windows.bat). This GUI works as well under Linux (most of the time) with Wine (otherwise launch "bash linux.sh").</p>\r\n<p>To sum up : at least three possible use :<br />- without OS : boot on the live DVD/USB to assess to the Linux version of SupertuxKart ("Live CD" or "Live USB" choice).<br />- under Windows : assess to the Windows multilingual GUI automatically or with "windows.bat"<br />- under Linux : use the tar.gz SupertuxKart 0.9 binary provided in the "binaries" directory or start the GUI with linux.sh (of course, you don''t need that if you have SupertuxKart 0.9 in the repositories, and if you have an internet access).</p>', 2704889856, '2015-07-02 16:57:30', 'SupertuxKart_remix_0-9_0-73.iso.torrent', 'labelstk0-9_200x200.jpg', 339),
(77, 'manjaro-xfce-0.8.13-x86_64', 'mumbly', 'manjaro-xfce-0-8-13-x86-64', '<p><strong>Manjaro Linux</strong>, ou tout simplement <strong>Manjaro</strong> (prononc&eacute; comme dans Kilimanjaro), est une distribution Linux utilisant <a class="mw-redirect" title="XFCE" href="https://fr.wikipedia.org/wiki/XFCE">XFCE</a> comme interface utilisateur par d&eacute;faut. C''est d''abord un syst&egrave;me d''exploitation libre pour ordinateurs personnels qui sait rester simple d''utilisation tout en mettant &agrave; disposition la richesse de la communaut&eacute; <a title="Arch Linux" href="https://fr.wikipedia.org/wiki/Arch_Linux">Arch Linux</a>. Il utilise par ailleurs un mod&egrave;le de d&eacute;veloppement similaire &agrave; sa grande s&oelig;ur, de type rolling release.</p>', '<p>Version : 0.8.13 XFCE 64 bits (x86_64)</p>\r\n<p>Manjaro Linux est bas&eacute;e sur <a title="Arch Linux" href="https://fr.wikipedia.org/wiki/Arch_Linux">Arch Linux</a> mais a un ensemble de d&eacute;p&ocirc;ts qui lui est propre. Elle cherche &agrave; &ecirc;tre conviviale pour un utilisateur d&eacute;butant, tout en conservant la puissante base Arch, principalement le gestionnaire de paquets pacman et la compatibilit&eacute; avec les d&eacute;p&ocirc;ts utilisateurs Arch (AUR).</p>\r\n<p>Manjaro elle-m&ecirc;me utilise trois ensembles de d&eacute;p&ocirc;ts logiciels sur ses sites miroirs :</p>\r\n<ul>\r\n<li>les d&eacute;p&ocirc;ts instables, contenant les paquets Arch les plus r&eacute;cemment d&eacute;velopp&eacute;s, avec un jour ou deux de retard&nbsp;;</li>\r\n<li>les d&eacute;p&ocirc;ts de tests, contenant des paquets provenant des d&eacute;p&ocirc;ts instables, synchronis&eacute;s avec ceux-ci chaque semaine et servant aux tests et aux corrections&nbsp;;</li>\r\n<li>les d&eacute;p&ocirc;ts stables, qui ne contiennent que les paquets jug&eacute;s stables par l''&eacute;quipe de d&eacute;veloppement.</li>\r\n</ul>\r\n<p>Infos : <a href="http://manjaro.org/">http://manjaro.org/</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/manjaro-small.png" alt="" width="480" height="384" /></p>', 1446789120, '2015-07-05 14:12:53', 'manjaro-xfce-0.8.13-x86_64.iso.torrent', 'manjaro.png', 250),
(85, 'debian-8.1.0-amd64-netinst', 'mumbly', 'debian-8-1-0-amd64-netinst', '<p>Debian (/de.bjan/) est une organisation communautaire et d&eacute;mocratique, dont le but est le d&eacute;veloppement de syst&egrave;mes d''exploitation bas&eacute;s exclusivement sur des logiciels libres.</p>\r\n<p>Chaque syst&egrave;me, lui-m&ecirc;me nomm&eacute; Debian, r&eacute;unit autour d''un noyau de syst&egrave;me d''exploitation de nombreux &eacute;l&eacute;ments pouvant &ecirc;tre d&eacute;velopp&eacute;s ind&eacute;pendamment les uns des autres, pour plusieurs architectures mat&eacute;rielles. Ces &eacute;l&eacute;ments, programmes de base compl&eacute;tant le noyau et logiciels applicatifs, se pr&eacute;sentent sous forme de &laquo; paquets &raquo; qui peuvent &ecirc;tre install&eacute;s en fonction des besoins (voir Distribution des logiciels). L''ensemble syst&egrave;me d''exploitation plus logiciels s''appelle une distribution.</p>\r\n<p>On assimile g&eacute;n&eacute;ralement ces syst&egrave;mes d''exploitation au syst&egrave;me Debian GNU/Linux, la distribution GNU/Linux de Debian, car jusqu''en 2009 c''&eacute;tait la seule branche parfaitement fonctionnelle. Mais d''autres distributions Debian sont en cours de d&eacute;veloppement en 2013 : Debian GNU/Hurd1,2 et Debian GNU/kFreeBSD3. La version Debian &laquo; Squeeze &raquo; est la premi&egrave;re &agrave; &ecirc;tre distribu&eacute;e avec le noyau kFreeBSD en plus du noyau Linux4.</p>\r\n<p>Debian est utilis&eacute;e comme base de nombreuses autres distributions telles que Knoppix et Ubuntu qui rencontrent un grand succ&egrave;s.</p>\r\n<p>Fin 2005, la distribution Debian a &eacute;t&eacute; retenue par la ville de Munich pour &eacute;quiper les quelque 14 000 ordinateurs de type PC qui formaient alors son parc informatique5. En 2014, un bilan &eacute;tabli par la nouvelle &eacute;quipe municipale6 annonce 14 millions d''euros (M&euro;) comme co&ucirc;t de la migration, compens&eacute;s partiellement par 11 M&euro; en &eacute;conomies de licences et de mat&eacute;riel. Le co&ucirc;t du retour &agrave; Windows est estim&eacute; par la m&ecirc;me &eacute;tude &agrave; 3 M&euro; de mat&eacute;riel, plus le co&ucirc;t des licences, inconnu puisque n&eacute;gociable.</p>', '<p>Version NetInstall :&nbsp;debian-8.1.0-amd64-netinst.iso</p>\r\n<p>Architecture : AMD64</p>\r\n<p>Infos : <a href="http://www.debian.org">http://www.debian.org</a></p>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://distrowatch.com/images/cgfjoewdlbc/debian-small.png" alt="" width="480" height="384" /></p>', 258998272, '2015-07-13 15:57:28', 'debian-8.1.0-amd64-netinst.iso.torrent', 'debian.png', 192);
